INSERT INTO `bills` (`id`, `number`, `name`, `summary`, `fullTextURL`, `url`) VALUES
(1, 'CS/SB 12', 'Mental Health and Substance Abuse', 'Including services provided to treatment-based mental health programs within case management funded from state revenues as an element of the state courts system; requiring assessment findings to be provided to the plan that is financially responsible for a child’s care in residential treatment under certain circumstances; specifying certain persons who are prohibited from being appointed as a person’s guardian advocate; authorizing a court to make a determination of involuntary outpatient services, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0012er.DOCX&DocumentType=Bill&BillNumber=0012&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56225'),
(2, 'HB 43', 'Churches or Religious Organizations', 'Provides that churches or religious organizations, related organizations, or certain individuals may not be required to solemnize any marriage or provide services, accommodations, facilities, goods, or privileges for related purposes if such action would violate sincerely held religious belief; prohibits certain legal actions, penalties, or governmental sanctions against such individuals or entities.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0043er.docx&DocumentType=Bill&BillNumber=0043&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54856'),
(3, 'CS/CS/HB 59', 'Agritourism', 'Prohibiting a local government from enforcing a local ordinance, regulation, rule, or policy that prohibits, restricts, regulates, or otherwise limits an agritourism activity on land classified as agricultural land; revising the term "agritourism activity"; providing conditions under which agritourism activities on farms or on lands classified as agricultural lands do not limit, restrict, or divest the land of such classification, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0059er.docx&DocumentType=Bill&BillNumber=0059&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54873'),
(4, 'CS/CS/HB 75', 'Electronic Monitoring Devices', 'Prohibits person from removing, destroying, altering, tampering with, damaging, or circumventing operation of electronic monitoring device being worn or used pursuant to court order or order by Florida Commission on Offender Review; prohibits request, authorization, or solicitation of person to perform such act; specifies that DOC may electronically monitor offender sentenced to community control when court has imposed electronic monitoring as condition of community control.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0075er.docx&DocumentType=Bill&BillNumber=0075&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54886'),
(5, 'SB 80', 'Family Trust Companies', 'Revising the purposes of the Family Trust Company Act; specifying the applicability of other chapters of the financial institutions codes to family trust companies; revising the requirements for investigations of license applicants by the Office of Financial Regulation; revising the authority of specified family trust companies while acting as fiduciaries to purchase certain bonds and securities, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0080er.DOCX&DocumentType=Bill&BillNumber=0080&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54825'),
(6, 'CS/CS/SB 86', 'Scrutinized Companies', 'Requiring the State Board of Administration to identify all companies that are boycotting Israel or are engaged in a boycott of Israel in which the public fund owns direct or indirect holdings by a specified date; requiring the public fund to create and maintain the Scrutinized Companies that Boycott Israel List that names all such companies; prohibiting a state agency or local governmental entity from contracting for goods and services that exceed a specified amount if the company has been placed on the Scrutinized Companies that Boycott Israel List, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0086er.DOCX&DocumentType=Bill&BillNumber=0086&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54828'),
(7, 'SB 88', 'Gold Star License Plates', 'Including certain individuals as qualified for issuance of a Gold Star license plate, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0088er.DOCX&DocumentType=Bill&BillNumber=0088&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54836'),
(8, 'CS/SB 90', 'Natural Gas Rebate Program', 'Authorizing the Department of Agriculture and Consumer Services to receive additional rebate applications from certain applicants; specifying preference for such applications, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0090er.DOCX&DocumentType=Bill&BillNumber=0090&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54837'),
(9, 'CS/CS/CS/HB 91', 'Severe Injuries Caused by Dogs', 'Provides for discretionary, rather than mandatory, quarantine or impoundment of dogs that cause severe injuries to humans; revises hearing & final order procedures & related confinement requirements, for dangerous dog actions; specifies circumstances under which dangerous dog that has caused severe injuries to human may be euthanized; authorizes local governments to adopt certain ordinances pertaining to dogs that have bitten or attacked persons or domestic animals; exempts law enforcement dogs from dangerous dog law.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0091er.docx&DocumentType=Bill&BillNumber=0091&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54908'),
(10, 'HB 93', 'Law Enforcement Officer Body Cameras', 'Requires law enforcement agency that permits its law enforcement officers to wear body cameras to establish policies & procedures addressing proper use, maintenance, & storage of cameras & data; requires such policies & procedures to include specified information; requires agency to ensure that specified personnel are trained; requires that data be retained in accordance with specified requirements; requires periodic review of agency body camera practices; exempts recordings from specified provisions relating to interception of wire, electronic, & oral communications.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0093er.docx&DocumentType=Bill&BillNumber=0093&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54911'),
(11, 'CS/SB 100', 'Pollution Discharge Removal and Prevention', 'Exempting nonprogram petroleum-contaminated sites from the application of risk-based corrective action principles under certain circumstances; revising how cleanup target levels are applied where surface waters are exposed to contaminated groundwater; providing additional contamination cleanup criteria for brownfield sites and brownfield areas; revising the eligibility requirements of the Abandoned Tank Restoration Program, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0100er.DOCX&DocumentType=Bill&BillNumber=0100&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54846'),
(12, 'CS/HB 103', 'Transactions in Fresh Produce Markets', 'Authorizing certain owners and operators of farmers'' markets, community farmers'' markets, flea markets, and other open-air markets selling fresh produce to allow authorized Food and Nutrition Service groups, associations, and third-party organizations to operate electronic benefits transfer systems in such markets; providing restrictions on the use of Supplemental Nutrition Assistance Program benefits in such markets, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0103er.docx&DocumentType=Bill&BillNumber=0103&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54927'),
(13, 'HB 111', 'Jury Service', 'Provides that certain persons incapable of caring for themselves may be permanently excluded from jury service upon request; provides requirements for such request.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0111er.docx&DocumentType=Bill&BillNumber=0111&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54938'),
(14, 'SB 112', 'Absentee Voting', 'Replacing the term “absentee ballot” with the term “vote-by-mail ballot”, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0112er.DOCX&DocumentType=Bill&BillNumber=0112&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54861'),
(15, 'CS/SB 124', 'Public-private Partnerships', 'Deleting provisions creating the Public-Private Partnership Guidelines Task Force; requiring a private entity that submits an unsolicited proposal to pay an initial application fee and additional amounts if the fee does not cover certain costs; deleting provisions relating to notice to affected local jurisdictions; authorizing a negotiated portion of revenues from fee-generating uses to be returned to the responsible public entity, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0124er.DOCX&DocumentType=Bill&BillNumber=0124&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54877'),
(16, 'CS/SB 126', 'Public Records and Public Meetings/Public-private Partnerships', 'Transferring, renumbering, and amending provisions relating to public-private partnerships for public facilities and infrastructure; providing an exemption from public records requirements for a specified period for unsolicited proposals received by a responsible public entity; providing an exemption from public records requirements for a specified period for the recording of, and any records generated during, a closed meeting; providing for future legislative review and repeal of the exemptions; providing a statement of public necessity, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0126er.DOCX&DocumentType=Bill&BillNumber=0126&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54878'),
(17, 'CS/HB 127', 'Continuing Care Facilities', 'Provides financial requirements for certain nursing homes to be designated as Gold Seal Program facilities.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0127er.docx&DocumentType=Bill&BillNumber=0127&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54956'),
(18, 'CS/CS/SB 130', 'Discharging a Firearm', 'Prohibiting the recreational discharge of a firearm in certain residential areas; providing criminal penalties; providing exceptions, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0130er.DOCX&DocumentType=Bill&BillNumber=0130&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54880'),
(19, 'CS/CS/HB 131', 'Unattended Persons and Animals in Motor Vehicles', 'Providing immunity from civil liability for damage to a motor vehicle related to the rescue of a person or animal under certain circumstances; providing applicability, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0131er.docx&DocumentType=Bill&BillNumber=0131&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54958'),
(20, 'CS/CS/HB 139', 'Dental Care', 'Establishes joint local & state dental care access account initiative, subject to availability of funding; requires DOH to implement EBT system; authorizes DOH to transfer state funds remaining in closed account at specified time & return unspent funds from local sources; requires DEO to rank shortage & medically underserved areas; requires DOH to develop loan program in cooperation with certain dental colleges & Florida Dental Association; provides rulemaking authority; provides appropriation & authorizes position.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0139er.docx&DocumentType=Bill&BillNumber=0139&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54973'),
(21, 'CS/CS/HB 145', 'Financial Transactions', 'Exempting a private school from the prohibition against charging certain convenience fees to a student or family paying tuition, fees, or other student account charges by credit card under certain circumstances; prohibiting a licensee from making payments to a person as compensation, inducement, or reward for referring loan applications to the licensee under certain circumstances; providing that chapter 670, F.S., governs certain funds transfers that are remittance transfers; reducing the time limit for a mortgagee or an assignee to cancel a mortgage, except in cases where the loan is an open-end mortgage, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0145er.docx&DocumentType=Bill&BillNumber=0145&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54984'),
(22, 'CS/CS/CS/HB 153', 'Healthy Food Financing Initiative', 'Directing the Department of Agriculture and Consumer Services to establish a Healthy Food Financing Initiative program to provide specified financing to rehabilitate or expand independent grocery stores and supermarkets in underserved communities within low-income communities; directing the termination of the program under certain conditions; providing an appropriation, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0153er.docx&DocumentType=Bill&BillNumber=0153&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55004'),
(23, 'CS/SB 158', 'Identification Cards and Driver Licenses', 'Providing for a person’s status as a lifetime freshwater fishing, saltwater fishing, hunting, or sportsman licensee, or boater safety identification cardholder, to be indicated on his or her identification card or driver license upon payment of an additional fee and presentation of the person’s lifetime freshwater fishing, saltwater fishing, hunting, or sportsman’s license, or boater safety identification card; providing a waiver of the replacement fee in certain circumstances, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0158er.DOCX&DocumentType=Bill&BillNumber=0158&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54905'),
(24, 'CS/HB 173', 'Medical Faculty Certification', 'Revises list of schools at which certain faculty members are eligible to receive medical faculty certificate to include Mayo Clinic College of Medicine & Florida Atlantic University.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0173er.docx&DocumentType=Bill&BillNumber=0173&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55023'),
(25, 'CS/SB 180', 'Trade Secrets', 'Including financial information in provisions prohibiting the theft, embezzlement, or unlawful copying of trade secrets; providing criminal penalties, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0180er.DOCX&DocumentType=Bill&BillNumber=0180&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54924'),
(26, 'CS/CS/SB 182', 'Public Records and Meetings/Trade Secrets', 'Expanding public records exemptions for certain data processing software obtained by an agency, certain information held by a county tourism promotion agency, information related to trade secrets held by specified entities, and specified data, programs, or supporting documentation held by an agency; providing for future legislative review and repeal of the exemptions; providing a statement of public necessity, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0182er.DOCX&DocumentType=Bill&BillNumber=0182&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54925'),
(27, 'CS/CS/CS/HB 183', 'Administrative Procedures', 'Revises requirements related to administrative proceedings regarding rules, proposed rules, unadopted rules, & agency statements; revises authorities of administrative law judges; revises provisions regarding noticing of agency actions; authorizes petitioners to pursue collateral challenges; expands agency reporting requirements of certain minor rules; revises certain timeframes in administrative proceedings; requires certain challenges for regulatory permits for special events to follow summary hearing provisions.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0183er.docx&DocumentType=Bill&BillNumber=0183&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55034'),
(28, 'CS/SB 184', 'Military and Veterans Affairs', 'Requiring a landlord, a condominium association, a cooperative association, or a homeowners’ association to complete the processing of a rental application submitted by a servicemember within a specified timeframe; requiring the Department of Highway Safety and Motor Vehicles to report monthly to the Department of Veterans’ Affairs the names and mailing or e-mail addresses of veterans who request information; directing the Department of Business and Professional Regulation to provide a method by which honorably discharged veterans may apply for construction, electrical or alarm system contracting licensure, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0184er.DOCX&DocumentType=Bill&BillNumber=0184&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54931'),
(29, 'CS/HB 189', 'Teacher Certification', 'Provides alternative requirements for earning professional educator certificate covering certain grades.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0189er.docx&DocumentType=Bill&BillNumber=0189&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55038'),
(30, 'CS/SB 190', 'Conservation Easements', 'Deleting a requirement that an exemption for a conservation easement must be renewed annually; providing that a property owner is not required to file a renewal application until the use of the property no longer complies with conservation easement requirements or restrictions, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0190er.DOCX&DocumentType=Bill&BillNumber=0190&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54935'),
(31, 'CS/HJR 193', 'Solar or Renewable Energy Source Devices/Exemption from Certain Taxation and Assessment', 'Proposing amendments to the State Constitution to authorize the Legislature, by general law, to exempt from ad valorem taxation the assessed value of solar devices or renewable energy source devices that are subject to tangible personal property tax, to authorize the Legislature, by general law, to prohibit the consideration of the installation of such devices in determining the assessed value of residential and nonresidential real property for the purpose of ad valorem taxation, and to provide effective and expiration dates, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0193er.docx&DocumentType=Bill&BillNumber=0193&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55045'),
(32, 'SB 194', 'Redevelopment Trust Fund', 'Adding certain hospital districts to the list of public bodies or taxing authorities that are exempt from appropriating certain revenues to the redevelopment trust fund, etc. ', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0194er.DOCX&DocumentType=Bill&BillNumber=0194&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54943'),
(33, 'CS/HB 195', 'Special Election', 'Providing for a special election to be held August 30, 2016, pursuant to Section 5 of Article XI of the State Constitution, for the approval or rejection by the electors of this state of amendments to the State Constitution, proposed by joint resolution, relating to an exemption from the tangible personal property tax for solar or renewable energy source devices, a limitation on the assessed value of real property used for nonresidential purposes for the installation of such devices, and an effective date if such amendments are adopted, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0195er.docx&DocumentType=Bill&BillNumber=0195&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55046'),
(34, 'CS/CS/SB 196', 'Public Records/State-funded Infrastructure Bank', 'Providing an exemption from public records requirements for financial information of a private entity applicant which the Department of Transportation requires as part of an application process for loans or credit enhancements from the state-funded infrastructure bank; providing for future legislative review and repeal of the exemption; providing a statement of public necessity, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0196er.DOCX&DocumentType=Bill&BillNumber=0196&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54944'),
(35, 'CS/CS/SB 202', 'Florida Association of Centers for Independent Living', 'Requiring that a specified agreement be maintained between the Florida Endowment Foundation for Vocational Rehabilitation and the Florida Association of Centers for Independent Living; requiring the program to provide additional support and services; requiring the program to reimburse the Florida Association of Centers for Independent Living for certain costs approved by the center’s board of directors, taking into consideration certain recommendations; revising the maximum amount of specified funds for each state attorney which may be used to administer the personal attendant and employment assistance program and to contract with the state attorneys participating in the tax collection enforcement diversion program, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0202er.DOCX&DocumentType=Bill&BillNumber=0202&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54947'),
(36, 'CS/SB 218', 'Offenses Involving Electronic Benefits Transfer Cards', 'Specifying acts that constitute trafficking in food assistance benefits cards and are subject to criminal penalties; providing criminal penalties, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0218er.DOCX&DocumentType=Bill&BillNumber=0218&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54964'),
(37, 'CS/CS/CS/HB 221', 'Health Care Services', 'Requiring a specified health insurance plan to provide specified coverage for treatment of Down syndrome; requiring a health insurer or a pharmacy benefits manager to only use a certain form; requiring hospitals, ambulatory surgical centers, specialty hospitals, and urgent care centers to comply with certain provisions as a condition of licensure; providing requirements for settlement offers between certain providers and health plans in a specified dispute resolution program, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0221er.docx&DocumentType=Bill&BillNumber=0221&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55070'),
(38, 'SB 222', 'Parking for Disabled Veterans', 'Requiring the governing body of each publicly owned or publicly operated airport to grant free parking to any vehicle displaying specified license plates for disabled veterans; clarifying that such license plates, rather than “DV” license plates, are exempt from certain parking fees charged by a county, municipality, or an agency thereof, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0222er.DOCX&DocumentType=Bill&BillNumber=0222&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54966'),
(39, 'CS/SB 228', 'Mandatory Minimum Sentences', 'Deleting aggravated assault from the list of convictions which carry a minimum term of imprisonment if during the commission of the offense the convicted person possessed a firearm or destructive device; deleting aggravated assault from the list of convictions which carry a minimum term of imprisonment if during the commission of the offense the convicted person possessed a semiautomatic firearm and its high-capacity detachable box magazine or a machine gun, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0228er.DOCX&DocumentType=Bill&BillNumber=0228&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54970'),
(40, 'CS/HB 229', 'Bullying and Harassment Policies in Schools', 'Requiring each school district to review its bullying and harassment policy at specified intervals; requiring each school principal to implement the bullying and harassment policy in a certain manner and integrate it with the school''s bullying prevention and intervention program; providing a short title for chapter 2010-217, Laws of Florida, relating to requirements for health education curricula and district school board policies on teen dating violence and abuse, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0229er.docx&DocumentType=Bill&BillNumber=0229&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55084'),
(41, 'CS/SB 230', 'Missing Persons with Special Needs', 'Creating pilot projects in specified counties to provide personal devices to aid search-and-rescue efforts for persons with special needs, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0230er.DOCX&DocumentType=Bill&BillNumber=0230&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54971'),
(42, 'CS/CS/HB 231', 'Motor Vehicle Manufacturer Licenses', 'Revises provisions for denial, suspension, or revocation of license of manufacturer, factory branch, distributor, or importer of motor vehicles; revises provisions for certain audits of service-related payments or incentive payments to dealer by an applicant or licensee & timeframe for performance of such audits, provisions for denial or chargeback of claims, & provisions relating to certain adverse actions against dealer that sold or leased motor vehicle to customer who exported vehicle to foreign country or who resold vehicle; prohibits failure to make certain payments to motor vehicle dealer for temporary replacement vehicles & requiring or coercing dealer to purchase goods or services from vendor designated by applicant or licensee; & provides procedures for approval of dealer to purchase goods or services from vendor not designated by applicant or licensee.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0231er.docx&DocumentType=Bill&BillNumber=0231&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55085'),
(43, 'CS/CS/CS/SB 232', 'Guardianship', 'Renaming the Statewide Public Guardianship Office to the Office of Public and Professional Guardians; revising the duties and responsibilities of the executive director for the Office of Public and Professional Guardians; providing that a guardian has standing to seek judicial review pursuant to specified provisions if his or her registration is denied, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0232er.DOCX&DocumentType=Bill&BillNumber=0232&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54974'),
(44, 'SB 238', 'Medical Assistant Certification', 'Repealing provisions relating to certification of a medical assistant by the American Association of Medical Assistants or as a Registered Medical Assistant by the American Medical Technologists, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0238er.DOCX&DocumentType=Bill&BillNumber=0238&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54978'),
(45, 'HB 241', 'Children and Youth Cabinet', 'Revises membership of Children & Youth Cabinet.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0241er.docx&DocumentType=Bill&BillNumber=0241&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55093'),
(46, 'CS/CS/SB 242', 'Infectious Disease Elimination Pilot Program', 'Citing this act as the “Miami-Dade Infectious Disease Elimination Act (IDEA)”; authorizing the University of Miami and its affiliates to establish a sterile needle and syringe exchange pilot program in Miami-Dade County; providing that the possession, distribution, or exchange of needles and syringes under the pilot program is not a violation of the Florida Comprehensive Drug Abuse Prevention and Control Act or any other law; requiring the pilot program to collect certain data for reporting purposes; prohibiting the collection of personal identifying information from program participants, etc. ', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0242er.DOCX&DocumentType=Bill&BillNumber=0242&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54982'),
(47, 'CS/CS/HB 249', 'Culinary Education Programs', 'Provides for applicability of DOH sanitation rules to licensed culinary education program; permits culinary education program with public food service establishment license to obtain alcoholic beverage license under certain conditions.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0249er.docx&DocumentType=Bill&BillNumber=0249&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55104'),
(48, 'CS/HB 273', 'Public Records', 'Requires public agency contract for services to include statement providing contact information of public agency''s custodian of public records; prescribes form of statement; revises required provisions in public agency contract for services regarding contractor''s compliance with public records laws; requires public records request relating to records for public agency''s contract for services to be made directly to public agency; requires contractor to provide requested records to public agency or allow inspection or copying of requested records; specifies circumstances under which court must assess & award reasonable costs of enforcement against contractor; specifies sufficient notice; provides that contractor who takes certain actions is not liable for reasonable costs of enforcement.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0273er.docx&DocumentType=Bill&BillNumber=0273&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55141'),
(49, 'CS/HJR 275', 'Homestead Tax Exemption/Senior, Low-Income, Long-Term Residents', 'Proposes amendment to State Constitution to specify calculation that county or municipality may use in determining just value for purposes of homestead tax exemption for certain persons age 65 or older; provides for retroactive applicability.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0275er.docx&DocumentType=Bill&BillNumber=0275&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55149'),
(50, 'CS/HB 277', 'County and Municipality Homestead Tax Exemption', 'Specifies calculation that county or municipality may use in determining just value for purposes of homestead tax exemption for certain persons aged 65 or older, if authorized by law; provides retroactive applicability; provides for contingent effect.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0277er.docx&DocumentType=Bill&BillNumber=0277&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55150'),
(51, 'CS/CS/SB 286', 'Merger and Acquisition Brokers', 'Providing an exemption from certain registration requirements with the Office of Financial Regulation for a specified offer or sale of securities; requiring a merger and acquisition broker to receive certain written assurances from a specified person prior to the completion of specified securities transactions; providing an exemption from certain registration requirements with the office for a merger and acquisition broker under certain circumstances; specifying disqualifying conditions for the exemption, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0286er.DOCX&DocumentType=Bill&BillNumber=0286&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55012'),
(52, 'CS/CS/CS/HB 287', 'Principal Autonomy Pilot Program Initiative', 'Creates Principal Autonomy Pilot Program Initiative; provides requirements for participation, exemptions, professional development, funding, rulemaking, & reporting; provides authorization period for participation in program; provides for renewal or revocation of authorization to participate in program; requires district school boards participating in program to provide certain funding allocations; provides additional authority & responsibilities of principal of participating school; provides appropriation.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0287er.docx&DocumentType=Bill&BillNumber=0287&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55158'),
(53, 'SB 288', 'State Designations', 'Providing an honorary designation of a certain state park in a specified county; designating and redesignating structures in the park; directing the Department of Environmental Protection to erect suitable markers, etc. ', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0288er.DOCX&DocumentType=Bill&BillNumber=0288&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55013'),
(54, 'CS/CS/HB 293', 'Public Records/Juvenile Criminal History Records', 'Specifies that certain confidential information obtained under ch. 985, F.S., relating to juvenile justice, is exempt from public records requirements; revises applicability of public records requirements with respect to arrest records of certain juvenile offenders; authorizes records custodians to choose not to electronically publish specified arrest or booking photos of juveniles; provides for future review & repeal of such applicability provisions; provides exemption from public records requirements for juvenile information compiled by Criminal Justice Information Program from intrastate sources; provides exceptions; provides for future review & repeal of exemption; provides for release by FDLE of criminal history information of juvenile which has been deemed confidential & exempt; reenacts provisions; provides statement of public necessity.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0293er.docx&DocumentType=Bill&BillNumber=0293&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55167'),
(55, 'CS/HB 299', 'Expressway Authorities', 'Revising membership of the governing body of certain expressway authorities; providing procedures when there is a vacancy or conclusion of a term; revising qualifications for membership on the governing body of certain expressway authorities; providing for termination from an authority''s governing body upon a finding of a violation of specified ethical conduct provisions or failure to comply with a notice of failure to comply with financial disclosure requirements, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0299er.docx&DocumentType=Bill&BillNumber=0299&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55175'),
(56, 'HB 303', 'Unlicensed Activity Fees', 'Prohibits DBPR from imposing specified fee in certain circumstances; providing for applicability of waiver.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0303er.docx&DocumentType=Bill&BillNumber=0303&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55187'),
(57, 'CS for CS/CS/HB 307 & HB 1313', 'Medical Use of Cannabis', 'Revising requirements for physicians ordering low-THC cannabis, medical cannabis, or a cannabis delivery device; revising the information that the Department of Health is required to include in its online compassionate use registry; providing that dispensing organizations may not dispense low-THC cannabis and medical cannabis unless they meet certain testing requirements; requiring the department to authorize certain dispensing organizations or applicants to provide low-THC cannabis, medical cannabis, and cannabis delivery devices to eligible patients, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0307er.docx&DocumentType=Bill&BillNumber=0307&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55189'),
(58, 'CS/SB 310', 'National Statuary Hall', 'Providing for replacement of the statue of General Edmund Kirby Smith in the National Statuary Hall Collection at the United States Capitol; requiring the Florida Council on Arts and Culture and the Department of State to estimate costs associated with the replacement of the statue; providing for submission of the state’s request to the United States Joint Committee on the Library of Congress for approval to replace the statue, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0310er.DOCX&DocumentType=Bill&BillNumber=0310&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55041'),
(59, 'SB 340', 'Vision Care Plans', 'Providing that a health insurer, a prepaid limited health service organization, and a health maintenance organization, respectively, may not require a licensed ophthalmologist or optometrist to join a network solely for the purpose of credentialing the licensee for another vision network; providing that such insurers and organizations may not restrict a licensed ophthalmologist, optometrist, or optician to specific suppliers of materials or optical laboratories, etc. ', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0340er.DOCX&DocumentType=Bill&BillNumber=0340&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55076'),
(60, 'CS/HB 347', 'Utility Projects', 'Authorizes certain local agencies to apply to certain local government agencies to finance costs of certain utility projects by issuing utility cost containment bonds; provides criteria in applying for funds; provides criteria of drafting financing resolution; provides procedures to establish or adjust utility projects; provides requirements for collection of project charges; specifies legal status of project charges for securing payment of bonds; specifies payment obligations & legal status of utility cost containment bonds.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0347er.docx&DocumentType=Bill&BillNumber=0347&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55228'),
(61, 'CS/SB 350', 'Procurement Procedures for Educational Institutions', 'Requiring each district school board and Florida College System institution board of trustees to review certain agreements and contracts before purchasing nonacademic commodities and contractual services under certain circumstances to determine whether the use of the agreements and contracts is economically advantageous; authorizing specified educational institutions to make purchases through an online procurement system, an electronic auction service, or other efficient procurement tool, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0350er.DOCX&DocumentType=Bill&BillNumber=0350&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55088'),
(62, 'CS/HB 373', 'Mental Health Counseling Interns', 'Revises mental health intern registration requirements; revises requirements for supervision of registered interns; deletes specified education & experience requirements; establishes validity period & provides for expiration of intern registrations; requires licensed mental health professional to be on premises when registered intern provides services in clinical social work, marriage & family therapy, & mental health counseling; deletes clinical experience requirement for such registered interns; deletes provision requiring that certain registered interns meet educational requirements for licensure.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0373er.docx&DocumentType=Bill&BillNumber=0373&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55276'),
(63, 'CS/HB 375', 'Physician Assistants', 'Revising circumstances under which a physician assistant may prescribe medication; authorizing a licensed physician assistant to perform certain services as delegated by a supervising physician; revising physician assistant licensure and license renewal requirements, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0375er.docx&DocumentType=Bill&BillNumber=0375&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55278'),
(64, 'CS/SB 380', 'Violation of an Injunction for Protection', 'Providing enhanced criminal penalties for a third or subsequent violation of an injunction for protection against specified acts of violence or a foreign protection order issued for the same victim under specified provisions, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0380er.DOCX&DocumentType=Bill&BillNumber=0380&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55113'),
(65, 'CS/HB 381', 'Public Records/Florida State Boxing Commission', 'Revises exemption from public records requirements with respect to certain proprietary confidential business information obtained by Florida State Boxing Commission; extends period for legislative review & repeal of exemption; provides statement of public necessity.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0381er.docx&DocumentType=Bill&BillNumber=0381&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55283'),
(66, 'CS/SB 386', 'Expunction of Records of Minors', 'Creating an exception for specified minors who, before attaining 21 years of age, had a criminal history record expunged; authorizing specified minors to apply for expunction of a criminal history record under certain circumstances; deleting a limitation on the period of time within which a minor must submit an application for prearrest or postarrest diversion expunction to the Department of Law Enforcement after successful completion of the diversion program, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0386er.DOCX&DocumentType=Bill&BillNumber=0386&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55130'),
(67, 'HB 387', 'Offenses Evidencing Prejudice', 'Designates act "Carl''s Law"; removes provisions relating to reclassification of offenses committed while evidencing prejudice based on mental or physical disability of victim from provisions relating to offenses evidencing prejudice generally & reenacts them in separate statute section.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0387er.docx&DocumentType=Bill&BillNumber=0387&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55287'),
(68, 'SB 396', 'Nonresident Plaintiffs in Civil Actions', 'Repealing specified provisions relating to requirements for a nonresident plaintiff in a civil action to post security for costs, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0396er.DOCX&DocumentType=Bill&BillNumber=0396&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55136'),
(69, 'CS/CS/HB 413', 'Title Insurance', 'Revises certain limitations on assumption of risk by title insurers; authorizes title insurer to obtain reinsurance from eligible reinsurer; revises applicability.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0413er.docx&DocumentType=Bill&BillNumber=0413&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55336'),
(70, 'CS/SB 416', 'Location of Utilities', 'Revising the circumstances under which a board of county commissioners is authorized to grant to a person or private corporation a license for specified projects related to lines for the transmission of certain public utilities and communication services; authorizing the Department of Transportation and certain local governmental entities to prescribe and enforce rules or regulations regarding the placement and maintenance of specified structures and lines within the right-of-way limits of roads or publicly owned rail corridors under their respective jurisdictions, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0416er.DOCX&DocumentType=Bill&BillNumber=0416&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55159'),
(71, 'HM 417', 'Article V Convention for Congressional Term Limits', 'Urges Congress to call Article V convention with sole agenda of proposing amendment to U.S. Constitution to limit consecutive terms of office that member of U.S. Senate or U.S. House of Representatives may serve.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0417er.docx&DocumentType=Bill&BillNumber=0417&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55338'),
(72, 'HB 419', 'Highlands Road and Bridge District, Pasco County', 'Abolishes Highlands Road and Bridge District, repeals special acts relating to district; transfers assets & liabilities to Pasco County.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0419er.docx&DocumentType=Bill&BillNumber=0419&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55346'),
(73, 'SB 422', 'Health Insurance Coverage For Opioids', 'Providing that a health insurance policy that covers abuse-deterrent opioid analgesic drug products may impose a prior authorization requirement for an abuse-deterrent opioid analgesic drug product only if the insurer imposes the same requirement for each opioid analgesic drug product without an abuse-deterrence labeling claim; prohibiting such health insurance policy from requiring use of an opioid analgesic drug product without an abuse-deterrence labeling claim before authorizing the use of an abuse-deterrent opioid analgesic drug product, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0422er.DOCX&DocumentType=Bill&BillNumber=0422&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55163'),
(74, 'HB 423', 'Access to Health Care Services', 'Expanding the categories of persons who may prescribe brand name drugs under the prescription drug program when medically necessary; requiring a certain percentage of surgical assistants and surgical technologists employed or contracting with a hospital to be certified; requiring advanced registered nurse practitioners and physician assistants who prescribe controlled substances for the treatment of certain pain to make a certain designation, comply with registration requirements, and follow specified standards of practice; designates "The Barbara Lumpkin Prescribing Act", etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0423er.docx&DocumentType=Bill&BillNumber=0423&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55348'),
(75, 'CS/CS/HB 427', 'Recreational Vessel Registration', 'Provides reduced recreational vessel registration fee schedule for vessels registered during specified period which are equipped with emergency position indicating radio beacon or for which owner of vessel owns personal locator beacon; limits application to one vessel per owner; authorizes DHSMV to adopt rules relating to proof of qualification; provides for certain funds to supplement reduced amounts collected; provides for expiration of reduced fee schedule; revises provisions relating to Marine Resources Conservation Trust Fund; provides for use of supplemental funds; revises provisions relating to county & municipality optional registration fees; specifies that reduced fees do not apply to limitation on registration fees charged by county.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0427er.docx&DocumentType=Bill&BillNumber=0427&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55350');
INSERT INTO `bills` (`id`, `number`, `name`, `summary`, `fullTextURL`, `url`) VALUES
(76, 'CS/CS/HB 431', 'Fire Safety', 'Revises provisions relating to certain structures located on agricultural property which are exempt from Florida Fire Prevention Code; requires that certain structures used for agritourism activity be classified; provides criteria for such classifications; provides that certain structures are subject to annual inspection; specifies applicable fire prevention standards; requires that State Fire Marshal adopt rules; revises certain dimensions of tent that is exempt from code; requires that State Fire Marshal adopt rules; authorizes local fire official to consider specified publication when identifying an alternative to firesafety code.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0431er.docx&DocumentType=Bill&BillNumber=0431&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55352'),
(77, 'CS/CS/SB 436', 'Crime of Making Threats of Terror or Violence', 'Creating the crime of falsely reporting the use of firearms in a violent manner against a person or persons; defining the terms “family member of a person” and “law enforcement officer”, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0436er.DOCX&DocumentType=Bill&BillNumber=0436&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55176'),
(78, 'CS/CS/CS/HB 439', 'Mental Health Services in the Criminal Justice System', 'Expanding eligibility for military veterans and servicemembers court programs; authorizing the creation of treatment-based mental health court programs; creating the Forensic Hospital Diversion Pilot Program; authorizing courts to order certain offenders on probation or community control to postadjudicatory mental health court programs, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0439er.docx&DocumentType=Bill&BillNumber=0439&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55371'),
(79, 'CS/CS/HB 447', 'Local Government Environmental Financing', 'Citing this act as the "Florida Keys Stewardship Act"; expanding the uses of local government infrastructure surtaxes to include acquiring any interest in land for public recreation, conservation, or protection of natural resources or to prevent or satisfy private property rights claims resulting from limitations imposed by the designation of an area of critical state concern; expanding the use of Everglades restoration bonds to include the City of Key West Area of Critical State Concern; authorizing bond proceeds to be spent on the City of Key West Area of Critical State Concern; requiring specific Florida Forever appropriations to be used for the purchase of lands in the Florida Keys Area of Critical State Concern, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0447er.docx&DocumentType=Bill&BillNumber=0447&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55379'),
(80, 'SB 450', 'Physical Therapy', 'Revising the definition of the term “practice of physical therapy”; providing that a licensed physical therapist who holds a specified doctoral degree may use specified letters in connection with her or his name or place of business; revising the terms and specified letters prohibited from being used by certain unlicensed persons, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0450er.DOCX&DocumentType=Bill&BillNumber=0450&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55183'),
(81, 'CS/SB 458', 'Transfers of Structured Settlement Payment Rights', 'Revising specified disclosures and notices that are or may be required to be given in order to effect transfers of structured settlement payment rights and payments under such rights; requiring the court to hold a hearing on the application; providing that following issuance of a court order approving the transfer, the structured settlement obligor and annuity issuer may rely on the order in redirecting certain payments and are released and discharged from certain liability, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0458er.DOCX&DocumentType=Bill&BillNumber=0458&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55195'),
(82, 'CS/HB 479', 'Special Districts', 'Revising legislative intent with respect to the Uniform Special District Accountability Act to include dependent special districts; specifying the Legislature''s authority to create dependent special districts by special act; providing for the identification of a dependent special district as dependent and an independent special district as independent in its charter; requiring the Department of Economic Opportunity to exclude inactive special districts from the official list of special districts; specifying that certain dependent special districts may be reviewed by specified local general purpose governments, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0479er.docx&DocumentType=Bill&BillNumber=0479&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55407'),
(83, 'HB 481', 'Columbia County Law Library', 'Abolishes Columbia County Law Library; transfers library''s assets & liabilities to Columbia County.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0481er.docx&DocumentType=Bill&BillNumber=0481&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55409'),
(84, 'CS/CS/CS/HB 491', 'Water and Wastewater', 'Requires Division of Bond Finance to review certain private activity bonds; exempts sales & leases to certain water utilities from sales tax; exempts from regulation person who resells water to certain entities; \r\nrequires utility reserve fund & provides uses; revises provisions addressing rate case expenses; authorizes PSC to review water quality & wastewater service; requires  counties to ensure service is not interrupted when water & wastewater systems are abandoned; expands entities to whom Water Pollution Control Financing Corporation may provide loans.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0491er.docx&DocumentType=Bill&BillNumber=0491&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55414'),
(85, 'CS/CS/SB 494', 'Digital Assets', 'Citing this act as the "Florida Fiduciary Access to Digital Assets Act"; authorizing a user to use an online tool to allow a custodian to disclose to a designated recipient or to prohibit a custodian from disclosing digital assets under certain circumstances; providing procedures for the disclosure of digital assets; authorizing the court to grant a guardian the right to access a ward’s digital assets under certain circumstances; imposing fiduciary duties, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0494er.DOCX&DocumentType=Bill&BillNumber=0494&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55230'),
(86, 'SB 498', 'Repeal of a Prohibition on Cohabitation', 'Deleting provisions prohibiting cohabitation by unmarried men and women, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0498er.DOCX&DocumentType=Bill&BillNumber=0498&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55234'),
(87, 'CS/CS/HB 499', 'Ad Valorem Taxation', 'Revising procedures for the revision of an erroneous or incomplete personal property tax return; requiring a property appraiser to serve a notice of intent to record a notice of tax lien under certain circumstances; revising the entities authorized to determine under certain circumstances that a petitioner owes ad valorem taxes or is owed a refund of overpaid taxes; revising requirements for an entity that may represent a taxpayer before the value adjustment board, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0499er.docx&DocumentType=Bill&BillNumber=0499&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55425'),
(88, 'CS/CS/SB 514', 'Supervisor of Elections Salaries', 'Revising the base salaries and group rates used to calculate additional compensation for a supervisor of elections based on population increments, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0514er.DOCX&DocumentType=Bill&BillNumber=0514&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55245'),
(89, 'HB 519', 'Gilchrist County Development Authority', 'Abolishes Gilchrist County Development Authority; transfers district''s assets & liabilities to Gilchrist County.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0519er.docx&DocumentType=Bill&BillNumber=0519&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55436'),
(90, 'HB 525', 'Small Community Sewer Construction Assistance Act', 'Revises definition of term "financially disadvantaged small community" to include counties & special districts; defines term "special district."', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0525er.docx&DocumentType=Bill&BillNumber=0525&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55444'),
(91, 'CS/CS/CS/HB 535', 'Building Codes', 'Revises provisions related to Florida Building Code; revises provisions regarding Florida Building Code Compliance and Mitigation Program; restricts application of Florida Building Code for certain aspects of construction; revises provisions related to portable pools; revises provisions regarding Florida Homeowners'' Construction Recovery Fund; revises minimum requirements for certificate of completion for residential swimming pools; revises provisions regarding authority of building officials to issue building permits; revises provisions regarding appeal boards; revising provisions addressing certain fire service access elevators; creates task force to study electrical safety in swimming pools; creates construction industry workforce task force to study issues associated with training of construction workforce.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0535er.docx&DocumentType=Bill&BillNumber=0535&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55460'),
(92, 'CS/CS/CS/SB 540', 'Estates', 'Providing that the validity and the effect of a specified disposition of real property be determined by Florida law; revising the right to elective share for a surviving spouse; authorizing a trustee to pay attorney fees and costs from the assets of the trust without specified approval or court authorization in certain circumstances; providing that specified qualified beneficiaries may be entitled to an order compelling the refund of a specified payment to the trust, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0540er.DOCX&DocumentType=Bill&BillNumber=0540&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55267'),
(93, 'HB 541', 'Addresses of Legal Residence', 'Defining the term "address of legal residence"; requiring a voter registration application to include the applicant''s address of legal residence and certain additional distinguishing information; specifying that an applicant''s failure to include such distinguishing information on a voter registration application does not affect his or her qualifications to register or vote or cast a ballot; providing that a list of valid addresses maintained by a supervisor of elections include certain additional distinguishing information, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0541er.docx&DocumentType=Bill&BillNumber=0541&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55468'),
(94, 'CS/CS/HB 545', 'Human Trafficking', 'Includes human trafficking as predicate offense for felony murder; prohibits permanently branding, or directing permanent branding, of victim of human trafficking; requires DOH to suspend license of massage therapist or massage establishment for specified violations in conjunction with establishment; provides that licensed massage therapist may not receive new or renewal license if applicant is convicted of certain prostitution offenses in conjunction with massage establishment; provides that licensed massage establishment may not receive new or renewal license if specified persons connected with establishment are convicted of certain prostitution offenses in conjunction with establishment; provides that minors may not be charged with specified prostitution offenses; requires person convicted of specified racketeering offenses to register as sexual predator or sexual offender; reenacts various provisions.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0545er.docx&DocumentType=Bill&BillNumber=0545&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55474'),
(95, 'HB 549', 'Offenses Concerning Racketeering and Illegal Debts', 'Authorizes investigative agency to institute civil proceeding for forfeiture in circuit court in certain circumstances; revises grounds for an action; authorizes court to order forfeiture of other property of defendant up to value of unavailable property in certain circumstances; authorizes DLA to bring an action for certain violations; provides for civil penalties for natural persons & other persons; authorizes party to specific civil action to petition for entry of consent decree or settlement agreement & provides requirements; revises provisions relating to subpoena confidentiality; provides that investigative agency has authority to stipulate to protective orders with respect to documents & information submitted in response to subpoena; provides for distribution of forfeiture proceeds to victims.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0549er.docx&DocumentType=Bill&BillNumber=0549&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55476'),
(96, 'CS/CS/SB 552', 'Environmental Resources', 'Requiring the Department of Environmental Protection to publish, update, and maintain a database of conservation lands; authorizing certain water management districts to designate and implement pilot projects; prohibiting water management districts from modifying permitted allocation amounts under certain circumstances; creating the “Florida Springs and Aquifer Protection Act”, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0552er.DOCX&DocumentType=Bill&BillNumber=0552&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55280'),
(97, 'CS/CS/HB 561', 'Organizational Structure of the Department of Environmental Protection', 'Establishes Office of the Secretary within DEP; authorizes Secretary of Environmental Protection to establish offices within the office & within department''s divisions to promote efficient & effective operation of DEP; directs secretary to appoint general counsel; removes required establishment of certain offices; establishes Division of Water Restoration Assistance within DEP.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0561er.docx&DocumentType=Bill&BillNumber=0561&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55487'),
(98, 'SB 576', 'Public Educational Facilities', 'Authorizing certain Florida College System institutions to construct dormitories for up to 300 beds for students; prohibiting the use of state funds and tuition and fee revenues for construction, debt service payments, maintenance, or operation of such dormitories, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0576er.DOCX&DocumentType=Bill&BillNumber=0576&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55298'),
(99, 'CS/SB 580', 'Reimbursement to Health Access Settings for Dental Hygiene Services for Children', 'Authorizing reimbursement for children’s dental services provided by licensed dental hygienists in certain circumstances, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0580er.DOCX&DocumentType=Bill&BillNumber=0580&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55300'),
(100, 'HB 585', 'Instruction for Homebound and Hospitalized Students', 'Requires school districts to provide instruction to homebound or hospitalized students; provides for student eligibility, methods of providing instruction to homebound or hospitalized students, & initiation of services.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0585er.docx&DocumentType=Bill&BillNumber=0585&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55511'),
(101, 'SB 586', 'Responsibilities of Health Care Providers', 'Repealing provisions relating to practice parameters for physicians performing caesarean section deliveries in provider hospitals; requiring a hospital to notify certain obstetrical physicians within a specified timeframe before the hospital closes its obstetrical department or ceases to provide obstetrical services, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0586er.DOCX&DocumentType=Bill&BillNumber=0586&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55306'),
(102, 'CS/CS/CS/HB 589', 'Environmental Control', 'Repealing provisions relating to violations of consumptive use permit conditions; providing conditions under which certain constructed clay settling areas are exempt from reclamation rate and financial responsibility requirements; requiring Florida registered professionals to certify that certain stormwater management systems will meet additional requirements for a general permit, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0589er.docx&DocumentType=Bill&BillNumber=0589&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55514'),
(103, 'CS/CS/CS/SB 590', 'Adoption', 'Redefining the terms “abandoned” or “abandonment” and “parent”; revising the circumstances under which an adoption consent is valid, binding, and enforceable; requiring a court to determine, under certain circumstances, whether a change of placement of a child is in the child’s best interests, rather than whether the change of placement is appropriate, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0590er.DOCX&DocumentType=Bill&BillNumber=0590&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55308'),
(104, 'CS/SB 592', 'Public Records/Department of Financial Services/Emergency Medical Technicians or Paramedics', 'Providing an exemption from public records requirements for the personal identifying and location information of certain nonsworn investigative personnel of the Department of Financial Services and the names and personal identifying and location information of the spouses and children of such personnel; providing an exemption from public records requirements for certain identifying and location information of current or former emergency medical technicians or paramedics certified under ch. 401, F.S., and the spouses and children of such emergency medical technicians or paramedics, under specified circumstances; providing for future review and repeal of the exemptions; providing statements of public necessity, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0592er.DOCX&DocumentType=Bill&BillNumber=0592&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55310'),
(105, 'CS/HM 601', 'Promotion of Economic Recovery in Puerto Rico', 'Urges Congress to enact certain legislation to promote economic recovery in Commonwealth of Puerto Rico.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0601er.docx&DocumentType=Bill&BillNumber=0601&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55526'),
(106, 'CS/HB 613', 'Workers'' Compensation System Administration', 'Deletes required item to be listed on notice of election to be exempt; revises specified rules regarding maintenance of business records by an officer of corporation; provides and removes duties of DFS; prohibits application of specified credit unless employer provides specified documentation & proof of payment to department within specified period; revises penalty calculation for imputed weekly payroll for an employee; eliminates certification requirements when expert medical advisor is selected by judge of compensation claims; deletes requirement that employers notify department within 24 hours of any injury resulting in death; revises requirements for filing claim; deletes preferred worker program; deletes notification fees on certain filed claims which supplement Special Disability Trust Fund; deletes fee for certain registration of insurance carriers.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0613er.docx&DocumentType=Bill&BillNumber=0613&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55539'),
(107, 'CS/SB 624', 'Public Records/State Agency Information Technology Security Programs', 'Creating exemptions from public records requirements for certain records held by a state agency which identify detection, investigation, or response practices for suspected or confirmed information technology security incidents and for certain portions of risk assessments, evaluations, external audits, and other reports of a state agency’s information technology program; providing for future legislative review and repeal of the exemptions; providing statements of public necessity, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0624er.DOCX&DocumentType=Bill&BillNumber=0624&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55341'),
(108, 'CS/SB 626', 'Consumer Credit', 'Authorizing the Office of Financial Regulation to deny a license or take disciplinary action against a person who violates the Military Lending Act or the regulations adopted under that act in connection with a consumer finance loan under the Florida Consumer Finance Act, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0626er.DOCX&DocumentType=Bill&BillNumber=0626&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55342'),
(109, 'CS/HB 627', 'Community Contribution Tax Credits', 'Defines terms related to community contribution tax credits that may apply against certain tax liabilities.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0627er.docx&DocumentType=Bill&BillNumber=0627&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55553'),
(110, 'SB 628', 'Fees for Records', 'Adding the Agency for Persons with Disabilities to the list of specified state entities and vendors that pay a reduced fee per record for criminal history information for each name submitted, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0628er.DOCX&DocumentType=Bill&BillNumber=0628&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55343'),
(111, 'HB 633', 'Public Food Service Establishments', 'Revises definition of term "public food service establishment" to exclude certain events; clarifies that food service license is not required if event is excluded under definition of term "public food service establishment."', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0633er.docx&DocumentType=Bill&BillNumber=0633&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55567'),
(112, 'CS/CS/SB 636', 'Evidence Collected in Sexual Offense Investigations', 'Requiring that a sexual offense evidence kit or other DNA evidence be submitted to a member of the statewide criminal analysis laboratory system within a specified timeframe after specified occurrences; requiring a medical provider or law enforcement agency to inform an alleged victim of a sexual offense of certain information relating to sexual offense evidence kits; requiring the testing of sexual offense evidence kits within a specified timeframe after submission to a member of the statewide criminal analysis laboratory, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0636er.DOCX&DocumentType=Bill&BillNumber=0636&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55357'),
(113, 'CS/HB 649', 'Eagle Bay Sub-Drainage District, Okeechobee County', 'Abolishes district; repeals special acts; transfers assets & liabilities of the district.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0649er.docx&DocumentType=Bill&BillNumber=0649&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55581'),
(114, 'CS/CS/CS/HB 651', 'Department of Financial Services', 'Authorizing the department to create an Internet-based transmission system to accept service of process; extending the repeal date of an exemption for medical malpractice insurance premiums from certain emergency assessments levied by the Office of Insurance Regulation for the Florida Hurricane Catastrophe Fund; authorizing service of process by specified means; establishing the Firefighter Assistance Program for certain purposes, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0651er.docx&DocumentType=Bill&BillNumber=0651&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55582'),
(115, 'HB 655', 'City of Jacksonville, Duval County', 'Establishes special zones in downtown Jacksonville; provides exceptions for space & seating requirements for liquor licenses for restaurants in the zones, subject to local zoning requirements.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0655er.docx&DocumentType=Bill&BillNumber=0655&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55586'),
(116, 'CS/CS/HB 659', 'Automobile Insurance', 'Provides exception to provision that deems use of single zip code as rating territory for insurance rates to be unfairly discriminatory; provides duties for OIR concerning such rates; authorizes Florida Automobile JUA & joint underwriting plan approved by OIR to cancel personal lines or commercial policies within specified time for nonpayment of premium due to certain reasons; prohibits insured from cancelling policy or binder within specified time except under certain conditions; requires that certain standard form be approved by office & adopted by FSC, rather than approved by office or adopted by commission; revises standards for compliance for specified billings for medical services; specifies additional entities that may receive reimbursement under Florida Motor Vehicle No-Fault Law regardless of whether they meet specified licensure requirement.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0659er.docx&DocumentType=Bill&BillNumber=0659&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55594'),
(117, 'SB 666', 'Voter Identification', 'Expanding the list of acceptable forms of identification for certain voter registration applicants to include veteran health identification cards, licenses to carry a concealed weapon or firearm, and certain government-issued employee identification cards, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0666er.DOCX&DocumentType=Bill&BillNumber=0666&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55394'),
(118, 'CS/CS/SB 668', 'Family Law', 'Requiring a court to consider certain alimony factors and make specific written findings of fact under certain circumstances; requiring a court to make specified findings before ruling on a request for alimony; specifying a premise that a minor child should spend approximately equal amounts of time with each parent; revising a finite list of factors that a court must evaluate when establishing or modifying parental responsibility or a parenting plan; prohibiting a court from changing the duration of alimony, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0668er.DOCX&DocumentType=Bill&BillNumber=0668&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55395'),
(119, 'SB 672', 'Educational Options', 'Creating the “Florida Postsecondary Comprehensive Transition Program Act”; establishing student eligibility requirements for enrollment in the program; establishing the Florida Center for Students with Unique Abilities; establishing a Florida Postsecondary Comprehensive Transition Program Scholarship for certain qualified students; authorizing certain school districts and charter schools to be eligible to receive incentive payments for implementing a standard student attire policy that meets certain criteria; changing the name of the “Florida Personal Learning Scholarship Account Program” to the “Gardiner Scholarship Program”, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0672er.DOCX&DocumentType=Bill&BillNumber=0672&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55401'),
(120, 'CS/HB 695', 'Title Insurance', 'Revises reserves that certain title insurers must set aside after certain date; revises manner in which reserves must be released; revises reserve requirements for title insurer who transfers domicile to this state; requires calculation of adjusted statutory premium reserve; requires increases to statutory premium reserves under certain circumstances; authorizes release of reserves to surplus in certain circumstances.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0695er.docx&DocumentType=Bill&BillNumber=0695&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55624'),
(121, 'CS/CS/SB 698', 'Alcoholic Beverages and Tobacco', 'Requiring the Division of Alcoholic Beverages and Tobacco to grant a one-time written waiver or extension of certain requirements to specified licensees; requiring an alcoholic beverage distributor to charge a deposit for certain alcoholic beverage sales; authorizing the division to issue temporary permits to charitable organizations, municipalities, and counties to sell alcoholic beverages for consumption on the premises of an event; authorizing a licensed distributor to transport alcoholic beverages through certain premises under specified circumstances, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0698er.DOCX&DocumentType=Bill&BillNumber=0698&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55442'),
(122, 'CS/HB 701', 'Art in the Capitol Competition', 'Creates the "Art in the Capitol Competition" for students in specified grades; provides procedures for student participation, notification, & selection & display of winning submissions.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0701er.docx&DocumentType=Bill&BillNumber=0701&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55627'),
(123, 'CS/HB 703', 'Vessels', 'Provides that vessel overloading or excessive speed constitutes careless operation of vessel; provides for issuance of safety inspection decals; prohibits law enforcement officers from stopping certain vessels solely to inspect for certain compliance; provides exception.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0703er.docx&DocumentType=Bill&BillNumber=0703&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55631'),
(124, 'CS/CS/SB 708', 'Arthur G. Dozier School for Boys', 'Requiring certain historical resources, records, archives, artifacts, researches, medical records, and human remains to remain in the custody of the University of South Florida; requiring the Department of State to contract with the university for the identification and location of eligible next of kin of certain children; requiring the department to notify the next of kin of certain payment or reimbursement provisions; establishing a task force to make recommendations regarding a memorial and a location of a site for the reinterment of unidentified or unclaimed remains, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0708er.DOCX&DocumentType=Bill&BillNumber=0708&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55449'),
(125, 'HB 709', 'City of Tallahassee, Leon County', 'Revises boundaries of downtown area for purposes of temporary permits to sell alcoholic beverages for consumption on premises at outdoor events on public right-of-way in downtown area of Tallahassee.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0709er.docx&DocumentType=Bill&BillNumber=0709&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55636'),
(126, 'SB 716', 'Florida Holocaust Memorial', 'Establishing the Florida Holocaust Memorial; providing for administration by the Department of Management Services; prohibiting the department from constructing and placing the memorial until certain conditions are met, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0716er.DOCX&DocumentType=Bill&BillNumber=0716&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55454'),
(127, 'CS/CS/HB 719', 'Education Personnel', 'Revises provisions relating to mandatory reports of child abuse, abandonment, & abuse, confidentiality of reports & records in cases of child abuse or neglect, teacher recruitment & retention, educator liability insurance, Education Practices Commission, & complaints against teachers & administrators; requires DOE to approve school leader preparation programs; provides program requirements.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0719er.docx&DocumentType=Bill&BillNumber=0719&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55651'),
(128, 'CS/CS/HB 739', 'Secondhand Dealers', 'Requiring that the record of a secondhand dealer transaction include digital photographs of the items; requiring secondhand dealers to notify a law enforcement official under certain circumstances; revising the required holding period for certain goods acquired by a dealer; authorizing an action in replevin against a secondhand dealer based on a right of possession to stolen goods; revising the period of time a secondhand dealer must hold secondhand goods at a registered location, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0739er.docx&DocumentType=Bill&BillNumber=0739&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55673'),
(129, 'CS/CS/HB 749', 'Agriculture', 'Revising the period during which certain agricultural lands in eradication or quarantine programs continue to be classified as such; exempting certain farm vehicles from registration requirements under certain circumstances;  preempting regulatory authority over commercial feed and feedstuff to the Department of Agriculture and Consumer Services; providing for conservation easement agreements to include provisions which allow agricultural activities under certain conditions, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0749er.docx&DocumentType=Bill&BillNumber=0749&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55678'),
(130, 'CS/CS/SB 752', 'Public Records/Agency Inspector General Personnel', 'Providing an exemption from public records requirements for certain identifying and location information of current or former personnel employed in an agency’s office of inspector general or internal audit department whose duties include auditing or investigating certain activities that could lead to criminal prosecution or administrative discipline, and the spouses and children thereof; providing for future legislative review and repeal of the exemption; providing a statement of public necessity, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0752er.DOCX&DocumentType=Bill&BillNumber=0752&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55494'),
(131, 'CS/SB 754', 'Public Records/Department of Agriculture and Consumer Services Criminal or Civil Intelligence or Investigative Information', 'Providing an exemption from public records requirements for criminal or civil intelligence or investigative information or any other information held by the Department of Agriculture and Consumer Services as part of an examination or investigation with another state or federal regulatory, administrative, or criminal justice agency; providing for future legislative review and repeal of the exemption; providing a statement of public necessity, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0754er.DOCX&DocumentType=Bill&BillNumber=0754&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55495'),
(132, 'CS/CS/HB 769', 'Mental Health Treatment', 'Provides for continuation of psychotropic medication by forensic & civil facilities for individuals receiving such medication before admission; provides timeframes within which competency & commitment hearings must be held; revises time for dismissal of certain charges for defendants who remain incompetent to proceed to trial; provides exceptions; provides timeframe within which commitment hearings must be held; requires that defendant be transported for such hearing.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0769er.docx&DocumentType=Bill&BillNumber=0769&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55700'),
(133, 'CS/CS/SB 772', 'Regulated Service Providers', 'Revising the composition of the Board of Professional Surveyors and Mappers; requiring the department to waive the initial registration fee for an intrastate mover for certain veterans, the spouses of such veterans, or certain business entities that have a majority ownership held by such veterans or spouses; exempting water-related amusement rides operated by lodging and food service establishments and membership campgrounds, amusement rides at private, membership-only facilities, and nonprofit permanent facilities from certain safety standards; authorizing certain tax collector offices, upon approval and confirmation of license issuance by the department, to print and deliver concealed weapon or firearm licenses, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0772er.DOCX&DocumentType=Bill&BillNumber=0772&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55513'),
(134, 'CS/HB 773', 'Special Assessments on Agricultural Lands', 'Prohibits counties & municipalities from levying special assessments on certain agricultural lands for fire protection services; provides specified exceptions.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0773er.docx&DocumentType=Bill&BillNumber=0773&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55706'),
(135, 'CS/CS/CS/HB 783', 'Unclaimed Property', 'Provides exception to unclaimed property reporting requirements; requires certain unclaimed funds to be deposited with CFO; revises aggregate value that constitutes small estate account; revises requirements for power of attorney used in recovery of unclaimed property; eliminates maximum fee provision for recovery; revises requirements for contracts to acquire ownership of or entitlement to unclaimed property; repeals provisions relating to void unclaimed property powers of attorney & purchase agreements.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0783er.docx&DocumentType=Bill&BillNumber=0783&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55714'),
(136, 'CS/CS/HB 785', 'St. Lucie County Fire District, St. Lucie County', 'Revises requirements for Board of Commissioners of St. Lucie County Fire District to borrow money.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0785er.docx&DocumentType=Bill&BillNumber=0785&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55715'),
(137, 'CS/HB 793', 'Florida Bright Futures Scholarship Program', 'Provides that initial award period & renewal period for students who are unable to accept initial award immediately after high school due to specific obligations begins upon completion of obligation; requires student, as prerequisite for certain awards, to identify social or civic issue or professional area of interest & develop specified plan; creates Florida Gold Seal CAPE Scholars award; provides appropriation.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0793er.docx&DocumentType=Bill&BillNumber=0793&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55727'),
(138, 'HB 799', 'Out-of-State Fee Waivers for Active Duty Servicemembers', 'Provides that active duty members of Armed Forces of U.S. residing or stationed outside of this state may receive out-of-state fee waivers; requires tuition & fees charged to such students to be below specified amount & for annual report of all out-of-state fee waivers for such individuals.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0799er.docx&DocumentType=Bill&BillNumber=0799&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55732'),
(139, 'SB 812', 'Reciprocal Insurers', 'Authorizing domestic reciprocal insurers to pay a portion of unassigned funds to their subscribers, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0812er.DOCX&DocumentType=Bill&BillNumber=0812&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55555'),
(140, 'HB 819', 'Sunset Review of Medicaid Dental Services', 'Providing for the future removal of dental services as a minimum benefit of managed care plans; requiring the Office of Program Policy Analysis and Government Accountability to provide a report to the Governor and Legislature; requiring the Agency for Health Care Administration to implement a statewide Medicaid prepaid dental health program upon the occurrence of certain conditions; specifying requirements for the program and the selection of providers, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0819er.docx&DocumentType=Bill&BillNumber=0819&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55746'),
(141, 'CS/HB 821', 'Reimbursement of Assessments', 'Prohibits agent or attorney representing claimant from directly or indirectly requesting, receiving, or obtaining reimbursement from claimant for assessments charged to agent or attorney by U.S. Department of Veterans Affairs; provides penalties.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0821er.docx&DocumentType=Bill&BillNumber=0821&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55748'),
(142, 'CS/CS/SB 826', 'Mobile Homes', 'Revising certain notice requirements for written complaints; requiring the Division of Florida Condominiums, Timeshares, and Mobile Homes to adopt rules to implement board member training requirements; authorizing a mobile home park owner to pass on non-ad valorem assessments to a tenant under certain circumstances; authorizing a mobile home purchaser to cancel or rescind the contract to purchase under certain circumstances, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0826er.DOCX&DocumentType=Bill&BillNumber=0826&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55565'),
(143, 'CS/CS/SB 828', 'Insurance Guaranty Association Assessments', 'Requiring the Office of Insurance Regulation to levy assessments for certain purposes; revising and providing requirements for the levy of assessments; requiring insurers and self-insurance funds to report certain premiums; requiring insurers to collect policy surcharges and pay assessments to the association; revising requirements for reporting premium for assessment calculations; revising and providing requirements and limitations for remittance of assessments to the association, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0828er.DOCX&DocumentType=Bill&BillNumber=0828&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55566'),
(144, 'CS/HB 837', 'Education Programs for Individuals with Disabilities', 'Exempting a foster child from specified eligibility provisions; providing that a student enrolled in a transition-to-work program is eligible for a John M. McKay Scholarship; creating a transition-to-work program for specific students enrolled in the John M. McKay Scholarships for Students with Disabilities Program; exempting a John M. McKay Scholarship award from a specified funding calculation, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0837er.docx&DocumentType=Bill&BillNumber=0837&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55759'),
(145, 'HB 845', 'Bay County Bridge Authority, Bay County', 'Abolishes Bay County Bridge Authority; transfers authority''s assets & liabilities to Bay County.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0845er.docx&DocumentType=Bill&BillNumber=0845&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55769'),
(146, 'CS/SB 846', 'Divers-down Warning Devices', 'Revising the definitions of the terms “divers-down buoy,” “divers-down flag,” and “divers-down symbol”; expanding the types of indicators or devices allowed to be used to signal the presence of submerged divers; specifying requirements for divers-down warning devices, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0846er.DOCX&DocumentType=Bill&BillNumber=0846&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55588'),
(147, 'HB 847', 'Pasco County', 'Repeals certain provisions relating to sewage treatment facility discharges into coastal waters within Pasco County or waters tributary thereto.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0847er.docx&DocumentType=Bill&BillNumber=0847&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55775'),
(148, 'CS/CS/SB 854', 'Funeral, Cemetery, and Consumer Services', 'Revising required information for licensure to include e-mail addresses; revising the prohibition against withdrawal or transfer of assets within the care and maintenance trust fund to include an exception; requiring a licensed cemetery company to request a method for withdrawal from the cemetery company’s care and maintenance trust fund; providing that an applicant for the embalmer apprentice program may not be licensed without a determination of character by the licensing authority, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0854er.DOCX&DocumentType=Bill&BillNumber=0854&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55593'),
(149, 'CS/SB 860', 'Foster Families', 'Designating the second week of February of each year as “Foster Family Appreciation Week”, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0860er.DOCX&DocumentType=Bill&BillNumber=0860&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55601'),
(150, 'HB 871', 'Broward County', 'Repeals penalty for exceeding speed limit in specified waterways; repeals requirements for erection of waterway speed limit signs.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0871er.docx&DocumentType=Bill&BillNumber=0871&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55797'),
(151, 'CS/HB 875', 'Motor Vehicle Service Agreement Companies', 'Revises & provides definitions relating to motor vehicle service agreement companies.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0875er.docx&DocumentType=Bill&BillNumber=0875&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55808');
INSERT INTO `bills` (`id`, `number`, `name`, `summary`, `fullTextURL`, `url`) VALUES
(152, 'HB 891', 'Northwest Florida Community Hospital Board of Trustees, Washington County', 'Abolishes Northwest Florida Community Hospital Board of Trustees; transfers board''s assets & liabilities to Washington County.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0891er.docx&DocumentType=Bill&BillNumber=0891&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55834'),
(153, 'CS/HB 895', 'West Manatee Fire and Rescue District, Manatee County', 'Revises provisions for terms of members of district''s board of commissioners; deletes obsolete provisions relating to initial commissioners; provides for continuation of staggered terms; confirming certain non-ad valorem assessment rates adopted by district on specified date; specifies that district may amend assessment rates authorized by district''s enabling legislation.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0895er.docx&DocumentType=Bill&BillNumber=0895&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55845'),
(154, 'SB 908', 'Organization of the Department of Financial Services', 'Authorizing the Chief Financial Officer, rather than the Division of Accounting and Auditing, to audit and adjust accounts of officers and those indebted to the state; revising the divisions and the location of bureaus within the divisions; amending provisions relating to the transfer of certain functions to the Division of Investigative and Forensic Services; amending provisions relating to the renaming of the Bureau of Unclaimed Property, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0908er.DOCX&DocumentType=Bill&BillNumber=0908&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55656'),
(155, 'HB 911', 'City of Delray Beach, Palm Beach County', 'Repeals City of Delray Beach''s civil service act; requires referendum.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0911er.docx&DocumentType=Bill&BillNumber=0911&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55865'),
(156, 'CS/CS/CS/SB 912', 'Fraudulent Activities Associated with Payment Systems', 'Revising the felony classification for unlawful conveyance of fuel; requiring retail petroleum fuel measuring devices fitted with scanning devices to have certain security measures; requiring the owner or operator of a device to have certain security measures in place within a specified timeframe upon notice from the Department of Agriculture and Consumer Services; revising the prohibition against trafficking in or possession of counterfeit credit cards, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0912er.DOCX&DocumentType=Bill&BillNumber=0912&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55659'),
(157, 'CS/SB 922', 'Solid Waste Management', 'Providing for the funding of a waste tire abatement program from the Solid Waste Management Trust Fund up to a specified percentage of total funds; authorizing the Department of Environmental Protection to use account funds to contract with a third party for the closing and long-term care of solid waste management facilities under specified circumstances; authorizing waste tire abatement programs under the small county consolidated grant program, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0922er.DOCX&DocumentType=Bill&BillNumber=0922&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55686'),
(158, 'CS/CS/HB 931', 'Operations of the Citizens Property Insurance Corporation', 'Specifying that a consumer representative appointed by the Governor to the Citizens Property Insurance Corporation''s board of governors is not prohibited from practicing in a certain profession if required or permitted by law or ordinance; revising the requirements for licensed agents of the corporation; revising provisions related to the corporation''s use of certain public and private hurricane loss-projection models in establishing certain rates; revising a provision to permit specified information from certain underwriting and claims files to be made available to certain entities; providing limitations for the use of such information by the entities, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0931er.docx&DocumentType=Bill&BillNumber=0931&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55890'),
(159, 'CS/CS/SB 936', 'Persons with Disabilities', 'Citing this act as the "The Wes Kleinert Fair Interview Act"; requiring the Department of Highway Safety and Motor Vehicles to issue an identification card exhibiting a special designation for a person who has a developmental disability under certain circumstances; requiring a law enforcement officer, correctional officer, or another public safety official to make a good faith effort, upon the request of a parent, a guardian, or the individual, to ensure that specified professionals are present at all interviews of an individual diagnosed with autism or an autism spectrum disorder, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0936er.DOCX&DocumentType=Bill&BillNumber=0936&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55693'),
(160, 'CS/CS/SB 938', 'Retail Sale of Dextromethorphan', 'Prohibiting a manufacturer, distributor, or retailer, or its employees and representatives, from knowingly or willfully selling a finished drug product containing dextromethorphan to a person younger than 18 years of age; prohibiting a person younger than 18 years of age from purchasing a finished drug product containing dextromethorphan, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0938er.DOCX&DocumentType=Bill&BillNumber=0938&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55699'),
(161, 'CS/CS/HB 941', 'Department of Health', 'Creating & revising reporting requirements for specified research programs; providing licensing requirements for military members & their spouses; revising provisions relating to regulatory activities of DOH & certain boards; revising education requirements for certain health professions to qualify for license renewal.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0941er.docx&DocumentType=Bill&BillNumber=0941&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55901'),
(162, 'CS/CS/SB 964', 'Prescription Drug Monitoring Program', 'Providing that certain acts of dispensing controlled substances in specified facilities are not required to be reported to the prescription drug monitoring program; authorizing the designee of a health care practitioner, pharmacist, pharmacy, prescriber, or dispenser or an impaired practitioner consultant to receive certain information from the prescription drug monitoring program, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0964er.DOCX&DocumentType=Bill&BillNumber=0964&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55728'),
(163, 'CS/CS/HB 965', 'Firesafety', 'Revises firesafety standards for assisted living facilities & provides exemption for certain assisted living facilities under certain conditions.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0965er.docx&DocumentType=Bill&BillNumber=0965&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55919'),
(164, 'CS/SB 966', 'Unclaimed Property', 'Revising a presumption of when funds held or owing under a matured or terminated life or endowment insurance policy or annuity contract are unclaimed; requiring an insurer to compare records of certain insurance policies, annuity contracts, and retained asset accounts against the United States Social Security Administration Death Master File or a certain database or service to determine whether a death is indicated and to update certain records; providing the circumstances under which a policy, a contract, or an account is deemed to be in force, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s0966er.DOCX&DocumentType=Bill&BillNumber=0966&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55736'),
(165, 'HB 967', 'Family Law', 'Designates act as "Collaborative Law Process Act"; provides that collaborative law process begins when parties enter into collaborative law participation agreement; prohibits tribunal from ordering party to participate in collaborative law process over party''s objection; provides conditions under which collaborative law process concludes, terminates, or continues; provides for confidentiality of communications made during collaborative law process; provides exceptions.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0967er.docx&DocumentType=Bill&BillNumber=0967&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55923'),
(166, 'CS/HB 971', 'Community Development Districts', 'Amends acreage threshold for establishment of community development district; authorizes district to contract with towing operator to remove vehicles or vessels from specified properties; authorizes up to certain number of districts to merge; provides for membership of surviving merged district; provides requirements of merger agreement; provides for public hearings; prohibits petition to merge from being filed within specified timeframe.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0971er.docx&DocumentType=Bill&BillNumber=0971&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55926'),
(167, 'CS/HB 977', 'Behavioral Health Workforce', 'Authorizing a second opinion for admission to a treatment facility to be provided by certain licensed physicians in all counties, rather than counties with a specified population size; restricting to physicians the authorization to dispense certain medications or prescribe certain controlled substances on the premises of a registered pain-management clinic; providing certification criteria for psychiatric nurses; providing that certain acts by a psychiatric nurse constitute grounds for denial of a license or disciplinary action, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0977er.docx&DocumentType=Bill&BillNumber=0977&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55931'),
(168, 'HB 981', 'Administrative Procedures', 'Provides additional requirements for calculation of estimated adverse impacts & regulatory costs.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0981er.docx&DocumentType=Bill&BillNumber=0981&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55933'),
(169, 'HB 989', 'Implementation of the Water and Land Conservation Constitutional Amendment', 'Requiring specified amounts of funds within the Land Acquisition Trust Fund to be appropriated for certain projects; providing a preference in the use of funds distributed for Everglades restoration projects for projects that reduce harmful discharges to the St. Lucie estuary and the Caloosahatchee estuary; requiring such appropriations to be reduced by an amount equal to the debt service paid on bonds issued for specified purposes, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h0989er.docx&DocumentType=Bill&BillNumber=0989&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55959'),
(170, 'CS/SB 1004', 'Public Records/Security System Plans', 'Revising exceptions to a public records exemption; providing exceptions to a public records exemption, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s1004er.DOCX&DocumentType=Bill&BillNumber=1004&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55777'),
(171, 'CS/HJR 1009', 'Tax Exemption for Totally and Permanently Disabled First Responders', 'Proposing an amendment to the State Constitution to authorize a first responder, who is totally and permanently disabled as a result of an injury sustained in the line of duty, to receive relief from ad valorem taxes assessed on homestead property, if authorized by general law, and to provide an effective date, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1009er.docx&DocumentType=Bill&BillNumber=1009&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55970'),
(172, 'CS/CS/HB 1025', 'Public Records/Utility Security Information', 'Defines term "utility"; provides exemption from public records requirements for information related to security of information technology systems or industrial control technology systems of utility owned or operated by local government; provides for future legislative review & repeal of exemption; provides statement of public necessity.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1025er.docx&DocumentType=Bill&BillNumber=1025&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56001'),
(173, 'SB 1030', 'Florida Statutes', 'Adopting the Florida Statutes 2016 and designating the portions thereof that are to constitute the official law of the state; providing that the Florida Statutes 2016 shall be effective immediately upon publication; providing that general laws enacted during the October 19-November 6, 2015, special session and prior thereto and not included in the Florida Statutes 2016 are repealed; providing that general laws enacted after the October 19-November 6, 2015, special session are not repealed by this adoption act, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s1030er.DOCX&DocumentType=Bill&BillNumber=1030&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55804'),
(174, 'CS/SB 1032', 'Florida Statutes', 'Amending provisions to conform to the directive of the Legislature in section 9 of chapter 2012-116, Laws of Florida, codified as section 11.242(5)(j), Florida Statutes, to prepare a reviser’s bill to omit all statutes and laws, or parts thereof, which grant duplicative, redundant, or unused rulemaking authority, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s1032er.DOCX&DocumentType=Bill&BillNumber=1032&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55805'),
(175, 'CS/CS/CS/HB 1033', 'Information Technology Security', 'Revising the membership of the Technology Advisory Council to include a cybersecurity expert; revising the duties of the Agency for State Technology; providing for the establishment of computer security incident response teams within state agencies; requiring the agency to establish an information technology policy for certain state contracts, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1033er.docx&DocumentType=Bill&BillNumber=1033&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56012'),
(176, 'CS/SB 1038', 'Florida Statutes', 'Reenacting, amending, and repealing provisions that have expired, have become obsolete, have had their effect, have served their purpose, or have been impliedly repealed or superseded; correcting grammatical, typographical, and like errors, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s1038er.DOCX&DocumentType=Bill&BillNumber=1038&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55810'),
(177, 'HB 1039', 'Babcock Ranch Community Independent Special District, Charlotte and Lee Counties', 'Expands district boundaries of Babcock Ranch Community Independent Special District to include areas of Lee County; requires referendum.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1039er.docx&DocumentType=Bill&BillNumber=1039&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56016'),
(178, 'SB 1040', 'Florida Statutes', 'Repealing and amending provisions which have become inoperative by noncurrent repeal or expiration and, pursuant to s. 11.242(5)(b) and (i), F.S., may be omitted from the 2016 Florida Statutes only through a reviser’s bill duly enacted by the Legislature, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s1040er.DOCX&DocumentType=Bill&BillNumber=1040&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55811'),
(179, 'CS/SB 1042', 'Judgments', 'Providing that an execution is valid and effective during the life of the order on which it is issued; specifying that persons to whom a Notice to Appear has been issued may obtain possession of property levied on by complying with certain procedures; specifying that a jury, if not waived, should be empaneled as soon as possible after service of a Notice to Appear, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s1042er.DOCX&DocumentType=Bill&BillNumber=1042&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55815'),
(180, 'CS/CS/SB 1044', 'Contraband Forfeiture', 'Requiring the seizing agency to apply for an order, within a certain timeframe, making a probable cause determination after the agency seizes property; increasing the evidentiary standard from clear and convincing evidence to proof beyond a reasonable doubt that a contraband article was being used in violation of the Florida Contraband Forfeiture Act for a court to order the forfeiture of the seized property, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s1044er.DOCX&DocumentType=Bill&BillNumber=1044&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55818'),
(181, 'CS/SB 1046', 'Farm Vehicles', 'Defining the term “covered farm vehicle” for purposes of the Florida Uniform Traffic Control Law; exempting the driver of a covered farm vehicle from commercial driver license requirements, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s1046er.DOCX&DocumentType=Bill&BillNumber=1046&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55821'),
(182, 'CS/CS/HB 1051', 'Anchoring Limitation Areas', 'Prohibits overnight anchoring of vessels in specified  anchoring limitation areas; provides exceptions, applicability, & penalties; authorizes law enforcement officers & agencies to remove & impound vessels; provides indemnification for such law enforcement officers & agencies in certain circumstances; provides requirements for contractors performing removal or impoundment activities; provides for issuance of citations & expiration.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1051er.docx&DocumentType=Bill&BillNumber=1051&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56022'),
(183, 'HB 1061', 'Nurse Licensure Compact', 'Creates Nurse Licensure Compact; provides for recognition of licenses in party states; provides requirements for obtaining & retaining multistate license; provides effect on current licensees; requires all party states to participate in coordinated licensure information system of all RNs & LPNs; provides for development of system, reporting procedures, & exchange of certain information between party states; establishes Interstate Commission of Nurse Licensure Compact Administrators; authorizes certain disciplinary action under compact for certain prohibited acts; requires Florida Center for Nursing to analyze supply & demand of nurses & make future projections; requires DOH to report significant investigative information on nurse licensee to coordinated licensure information system; requires nurse holding multistate license to report participation in treatment program to department; provides eligibility criteria for multistate license.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1061er.docx&DocumentType=Bill&BillNumber=1061&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56028'),
(184, 'HB 1063', 'Public Records and Meetings/Nurse Licensure Compact', 'Provides exemption from public records requirements for certain information held by DOH or Board of Nursing pursuant to Nurse Licensure Compact; provides exemption from public meeting requirements for certain meetings of Interstate Commission of Nurse Licensure Compact Administrators; provides exemption from public records requirements for recordings, minutes, & records generated during closed portions of such meetings; provides for future legislative review & repeal of exemptions; provides statement of public necessity; provides for contingent effect.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1063er.docx&DocumentType=Bill&BillNumber=1063&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56029'),
(185, 'CS/HB 1071', 'South Broward Hospital District, Broward County', 'Revises authority of district''s board of commissioners to invest funds; authorizes investments listed in investment policy adopted by board & deletes list of authorized investments.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1071er.docx&DocumentType=Bill&BillNumber=1071&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56041'),
(186, 'CS/CS/HB 1075', 'State Areas', 'Creates, revises, & deletes provisions relating to acquisition, surplus, sale, lease, & use of state-owned  conservation, nonconservation, recreation, & submerged lands; provides appropriation & authorizes positions.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1075er.docx&DocumentType=Bill&BillNumber=1075&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56045'),
(187, 'HB 1081', 'North Sumter County Hospital District, Sumter County', 'Abolishes district; transfers assets & liabilities to Sumter County.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1081er.docx&DocumentType=Bill&BillNumber=1081&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56053'),
(188, 'CS/CS/HB 1083', 'Agency for Persons with Disabilities', 'Repealing provisions relating to a program for the prevention and treatment of severe self-injurious behavior; providing for the assignment of priority to clients waiting for waiver services; adding client needs that qualify as extraordinary needs, which may result in the approval of an increase in a client''s allocated funds; providing qualification requirements for the supervisor of the clinical director of a specified licensee, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1083er.docx&DocumentType=Bill&BillNumber=1083&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56056'),
(189, 'CS/CS/SB 1104', 'Service of Process on Financial Institutions', 'Requiring service on financial institutions to be made in accordance with s. 655.0201, F.S.; revising applicability of provisions of law governing service of process on financial institutions; authorizing certain financial institutions to designate with the Department of State a place or registered agent within the state as the sole location or agent for service of process, notice, levy, or demand, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s1104er.DOCX&DocumentType=Bill&BillNumber=1104&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55887'),
(190, 'CS/SB 1106', 'International Trust Entities', 'Providing for a moratorium for a specified timeframe on enforcement by the Office of Financial Regulation of certain licensure requirements for certain organizations and entities providing services to international trust companies; providing conditions to apply the moratorium to specified persons of the organization or entity; requiring the office to issue a notice of denial if it determines that an organization or entity is not a party to the moratorium, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s1106er.DOCX&DocumentType=Bill&BillNumber=1106&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55888'),
(191, 'SB 1110', 'Central Florida Expressway Authority', 'Requiring the chairs of the boards of specified county commissions each to appoint one member from his or her respective county who is a commission member or chair or the county mayor to serve on the governing body of the authority; specifying that the terms of members appointed by the Governor end on a specified date; specifying that the Central Florida Expressway Authority is a party to a certain lease-purchase agreement between the Department of Transportation and the Orlando-Orange County Expressway Authority, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s1110er.DOCX&DocumentType=Bill&BillNumber=1110&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55895'),
(192, 'CS/CS/CS/HB 1125', 'Eligibility for Employment as Child Care Personnel', 'Provides criteria for disqualification from employment for child care personnel; requires that certain persons who have been granted an exemption from disqualification from child care employment be rescreened by specified date; provides applicability with respect to specified provisions adopted during same legislative session.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1125er.docx&DocumentType=Bill&BillNumber=1125&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56116'),
(193, 'CS/CS/CS/HB 1133', 'Applicability of Revenue Laws to Out-of-state Businesses During Disaster-Response Periods', 'Provides exemptions from certain registration & licensing requirements & taxes for out-of-state businesses & employees that enter the state in response to disasters or emergencies; specifies applicability of certain transaction taxes & fees; specifies obligations & privileges of out-of-state businesses or employees after disaster-response periods.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1133er.docx&DocumentType=Bill&BillNumber=1133&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56131'),
(194, 'CS/HB 1147', 'Character-development Instruction', 'Requires character-development programs to provide certain instruction to students in grades 9-12.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1147er.docx&DocumentType=Bill&BillNumber=1147&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56145'),
(195, 'CS/HB 1149', 'Alternative Sanctioning', 'Authorizes chief judge of each judicial circuit, in consultation with specified entities, to establish alternative sanctioning program; authorizes offender who allegedly commits technical violation of supervision to waive participation in or elect to participate in program, admit to violation, agree to comply with recommended sanction, & agree to waive certain rights; authorizes court to impose recommended sanction or direct DOC to submit violation report, affidavit, & warrant to court; specifies that offender''s participation in alternative sanctioning program is voluntary. ', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1149er.docx&DocumentType=Bill&BillNumber=1149&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56146'),
(196, 'CS/HB 1157', 'Postsecondary Education for Veterans', 'Directs DOE to award postsecondary course credit for specified training, education, examinations & tests; revises residency requirement for certain tuition waivers for recipients of specified military decorations; provides that specified programs & test scores meet certain educator certification requirements.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1157er.docx&DocumentType=Bill&BillNumber=1157&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56160'),
(197, 'CS/CS/SB 1170', 'Health Plan Regulatory Administration', 'Authorizing local governmental units to contract for certain group insurance with a corporation not for profit whose membership consists of specified local governmental units; deleting a provision authorizing group insurance plans to impose a certain preexisting condition exclusion; requiring a health maintenance organization that issues a health insurance contract, rather than a group health insurance contract, to renew or continue in force such coverage at the contract holder’s option, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s1170er.DOCX&DocumentType=Bill&BillNumber=1170&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55958'),
(198, 'CS/SB 1174', 'Residential Facilities', 'Specifying applicability of siting requirements for community residential homes; providing applicability with respect to local land use and zoning, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s1174er.DOCX&DocumentType=Bill&BillNumber=1174&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55963'),
(199, 'CS/CS/HB 1175', 'Transparency in Health Care', 'Requiring a facility licensed under ch. 395, F.S., to provide timely and accurate financial information and quality of service measures to certain individuals; requiring a health care practitioner to provide a patient upon his or her request a written or electronic good faith estimate of anticipated charges within a certain timeframe; requiring a health insurer to make available on its website certain methods that a policyholder can use to make estimates of certain costs and charges; revising a requirement that a health maintenance organization make certain information available to its subscribers, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1175er.docx&DocumentType=Bill&BillNumber=1175&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56203'),
(200, 'CS/SB 1176', 'Dredge and Fill Activities', 'Revising the acreage of wetlands and other surface waters subject to impact by dredge and fill activities under a state programmatic general permit; providing that seeking to use such a permit consents to specified federal wetland jurisdiction criteria; deleting certain conditions limiting when the department may assume federal permitting programs for the discharge of dredged or fill material, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s1176er.DOCX&DocumentType=Bill&BillNumber=1176&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55964'),
(201, 'CS/CS/HB 1181', 'Bad Faith Assertions of Patent Infringement', 'Prohibits persons from sending demand letters to targets which make bad faith assertions of patent infringement; specifies what constitutes such letters; repeals provisions requiring that plaintiffs post specified bonds;\r\nauthorizes award of actual damages; revises provisions authorizing award of punitive damages.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1181er.docx&DocumentType=Bill&BillNumber=1181&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56211'),
(202, 'SB 1202', 'Discounts on Public Park Entrance Fees and Transportation Fares', 'Requiring counties and municipalities to provide a partial or a full discount on park entrance fees to military members, veterans, and the spouse and parents of certain deceased military members, law enforcement officers, firefighters, emergency medical technicians, and paramedics; requiring certain regional transportation authorities to provide a partial or a full discount on fares for certain disabled veterans, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s1202er.DOCX&DocumentType=Bill&BillNumber=1202&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55982'),
(203, 'HB 1205', 'Fumigation', 'Authorizing the Department of Agriculture and Consumer Services to adopt safety procedures for the clearance of residential structures before reoccupation after fumigation; authorizing the department to establish certain conditions for the registration or reregistration of fumigants, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1205er.docx&DocumentType=Bill&BillNumber=1205&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56233'),
(204, 'CS/HB 1219', 'Veterans'' Employment', 'Requires state agencies, & authorizes political subdivisions of state, to develop & implement veterans'' recruitment plan; requires DMS to collect specified data & include such data in its annual workforce report & on its website; provides applicability.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1219er.docx&DocumentType=Bill&BillNumber=1219&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56247'),
(205, 'HB 1221', 'Barron Water Control District, Glades and Hendry Counties', 'Abrogates scheduled abolition of Barron Water Control District.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1221er.docx&DocumentType=Bill&BillNumber=1221&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56251'),
(206, 'CS/HB 1233', 'Federal Home Loan Banks', 'Authorizes OFR to furnish certain information relating to Federal Home Loan Banks pursuant to information sharing agreement; requires OFR to execute such agreement by specified date.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1233er.docx&DocumentType=Bill&BillNumber=1233&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56258'),
(207, 'HB 1241', 'Ordering of Medication', 'Providing that a pharmacist may dispense an emergency opioid antagonist pursuant to a non-patient-specific standing order for an autoinjection delivery system or intranasal application delivery system; revising the authority of a licensed physician assistant to order medication under the direction of a supervisory physician for a specified patient; revising the term "prescription" to exclude an order for drugs or medicinal supplies dispensed for administration; authorizing a licensed practitioner to authorize a licensed physician assistant or advanced registered nurse practitioner to order controlled substances for a specified patient under certain circumstances, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1241er.docx&DocumentType=Bill&BillNumber=1241&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56270'),
(208, 'CS/HB 1245', 'Medicaid Provider Overpayments', 'Authorizes AHCA to certify that Medicaid provider is out of business & that overpayments made to provider cannot be collected under state law; revises method for verifying vendor delivery of home health services under home health agency monitoring pilot project.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1245er.docx&DocumentType=Bill&BillNumber=1245&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56281'),
(209, 'HB 1265', 'Greater Naples Fire Rescue District, Collier County', 'Expands district boundaries; requires referendum.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1265er.docx&DocumentType=Bill&BillNumber=1265&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56298'),
(210, 'CS/HB 1267', 'Greater Naples Fire Rescue District, Collier County', 'Expands district boundaries; requires referendum.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1267er.docx&DocumentType=Bill&BillNumber=1267&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56302'),
(211, 'CS/CS/SB 1274', 'Limited Sinkhole Coverage Insurance', 'Specifying the amount of surplus funds required for domestic insurers applying for a certificate of authority to provide limited sinkhole coverage insurance; authorizing certain insurers to offer limited sinkhole coverage insurance in this state; requiring the insurer to notify the Office of Insurance Regulation before writing limited sinkhole coverage insurance and to file a plan of operation with the office, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s1274er.DOCX&DocumentType=Bill&BillNumber=1274&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56050'),
(212, 'CS/SB 1288', 'Emergency Management', 'Defining the term “activate” for purposes of part I of ch. 252, F.S.; directing the Division of Emergency Management to create a statewide system to facilitate the transport and distribution of essentials in commerce during a declared emergency; directing the division to create a certification system for persons transporting or distributing essentials in commerce, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s1288er.DOCX&DocumentType=Bill&BillNumber=1288&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56070'),
(213, 'CS/SB 1294', 'Victim and Witness Protection', 'Increasing the maximum age at which a victim or witness may be allowed to testify via closed circuit television rather than in a courtroom in certain circumstances; increasing the maximum age of victims and witnesses for whom the court may enter protective orders; including human trafficking and lewd and lascivious offenses in the rules of evidence applicable to sexually-related offenses, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s1294er.DOCX&DocumentType=Bill&BillNumber=1294&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56077'),
(214, 'CS/HB 1297', 'Discretionary Sales Surtaxes', 'Revises provisions concerning defined benefit retirement plans or systems; authorizes county to levy pension liability surtax by ordinance if certain conditions are met; prescribing form of ballot statement; requires DOR to distribute surtax proceeds; specifies manner in which local government may use surtax proceeds; prescribes requirements for imposition of surtax; specifies conditions under which surtax terminates; limits combined rate of specified discretionary sales surtaxes.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1297er.docx&DocumentType=Bill&BillNumber=1297&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56384'),
(215, 'CS/HB 1305', 'Emergency Allergy Treatment in Schools', 'Authorizes public school & private school, respectively, to enter into certain arrangements with wholesale distributors or manufacturers for epinephrine auto-injectors.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1305er.docx&DocumentType=Bill&BillNumber=1305&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56390'),
(216, 'CS/CS/SB 1318', 'Shellfish Harvesting', 'Revising provisions directing the Department of Agriculture and Consumer Services, in cooperation with the Fish and Wildlife Conservation Commission and the Department of Environmental Protection, to protect specified shellfish beds, grounds, and reefs; providing for the Board of Trustees of the Internal Improvement Trust Fund to authorize the use of dredges or mechanical harvesting devices as special lease conditions of sovereign submerged land leases under certain circumstances; authorizing the department, rather than requiring, to designate areas for the taking of oysters and clams to be planted on public lands, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s1318er.DOCX&DocumentType=Bill&BillNumber=1318&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56092'),
(217, 'CS/SB 1322', 'Juvenile Detention Costs', 'Requiring certain counties that are not fiscally constrained counties to each pay to the Department of Juvenile Justice its annual percentage share of specified amounts for specified fiscal years; requiring such counties to pay its annual percentage share of the specified amounts in 12 equal payments beginning on a specified date; requiring a county that is not fiscally constrained county to incorporate into its annual budget sufficient funds to pay its annual percentage share; requiring certain funds to be deposited into the Shared County/State Juvenile Detention Trust Fund, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s1322er.DOCX&DocumentType=Bill&BillNumber=1322&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56094'),
(218, 'CS/HB 1333', 'Sexual Offenders', 'Revises sexual predator & offender criteria; revises reporting & registration requirements; revises elements of offense of loitering or prowling by certain offenders in close proximity to children; revises provisions relating for venue for proceedings for seeking removal of requirement to register as sexual predator or offender; requires that removal of registration requirement not conflict with federal law requirement; revises requirements concerning information to be released by DOC & DJJ regarding sexual offenders being released.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1333er.docx&DocumentType=Bill&BillNumber=1333&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56408'),
(219, 'CS/HB 1335', 'Long-term Care Managed Care Prioritization', 'Requires DEA to maintain statewide wait list for enrollment for home & community-based services through Medicaid long-term care managed care program; requires the department to prioritize individuals for potential enrollment using frailty-based screening tool that provides priority score; provides for determinations regarding offers of enrollment.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1335er.docx&DocumentType=Bill&BillNumber=1335&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56409'),
(220, 'CS/HB 1339', 'City of Webster, Sumter County', 'Provides charter of City of Webster; codifies, amends, repeals, & reenacts special acts relating to charter.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1339er.docx&DocumentType=Bill&BillNumber=1339&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56411'),
(221, 'CS/CS/HB 1347', 'Illicit Drugs', 'Revises definitions relating to controlled substances; revises schedules of controlled substances; provides additional factors to be considered in determining whether substance is controlled substance analog; revises how controlled substance analog is treated for purposes of drug abuse prevention & control; authorizes local actions to abate nuisances involving two or more violations of Florida Drug & Cosmetic Act within specified period; specifies additional substances that may be deemed contraband; revises lists of precursor & essential chemicals; specifies that crimes involving misbranded drugs are "racketeering activity" for purposes of Florida RICO Act; reenacts numerous provisions.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1347er.docx&DocumentType=Bill&BillNumber=1347&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56415'),
(222, 'CS/CS/HB 1355', 'Gainesville Regional Utilities, Alachua County', 'Creates Gainesville Regional Utilities Authority; requires referendum.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1355er.docx&DocumentType=Bill&BillNumber=1355&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56424'),
(223, 'CS/CS/HB 1361', 'Growth Management', 'Authorizing county boards to meet and discuss matters of mutual interest with specified counties or municipalities upon due public notice; providing timeframes within which the Division of Administrative Hearings must transmit certain recommended orders to the Administration Commission; providing that comprehensive plan amendments and land development regulations in the Apalachicola Bay Area of critical state concern will be reviewed and approved by the state land planning agency, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1361er.docx&DocumentType=Bill&BillNumber=1361&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56430'),
(224, 'CS/CS/HB 1365', 'Competency-Based Education Pilot Program', 'Creates Competency-Based Education Pilot Program; provides for program participation, application requirements, exemption from specified rules, student funding, & duties of DOE.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1365er.docx&DocumentType=Bill&BillNumber=1365&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56433'),
(225, 'CS/CS/SB 1386', 'Insurance Agents', 'Revising a prohibition against a licensed insurance agent from receiving a specified fee or commission for examining any health insurance or any health benefit plan, rather than any group health insurance or any group health benefit plan, for certain purposes; revising amounts of coverage of certain life insurance policies that may be sold by specified persons, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s1386er.DOCX&DocumentType=Bill&BillNumber=1386&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56149'),
(226, 'SB 1402', 'Ratification of Department of Financial Services Rules', 'Ratifying a specified rule relating to the Florida Workers’ Compensation Health Care Provider Reimbursement Manual for the sole and exclusive purpose of satisfying any condition on effectiveness pursuant to s. 120.541(3), F.S., which requires ratification of any rule exceeding the specified thresholds for likely adverse impact or increase in regulatory costs; providing applicability, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s1402er.DOCX&DocumentType=Bill&BillNumber=1402&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56158'),
(227, 'CS/CS/HB 1411', 'Termination of Pregnancies', 'Revising the requirements for disposal of fetal remains; revising the criminal punishment for failure to properly dispose of fetal remains; requiring the Agency for Health Care Administration to develop and enforce rules relating to license inspections and investigations of certain clinics; requiring certain organizations that provide abortion referral services or abortion counseling services to register with the agency, pay a specified fee, and include certain\ninformation in advertisements, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1411er.docx&DocumentType=Bill&BillNumber=1411&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56464'),
(228, 'SB 1412', 'Orders of No Contact', 'Revising the requirements for notifying a defendant of a no contact order if issued by the court as a condition of pretrial release, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s1412er.DOCX&DocumentType=Bill&BillNumber=1412&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56165'),
(229, 'CS/CS/SB 1416', 'Public Records/Own-risk and Solvency Assessment/Corporate Governance Annual Disclosure', 'Providing an exemption from public records requirements for certain reports and documents submitted to the Office of Insurance Regulation related to an own-risk and solvency assessment by an insurer or insurance group; providing an exemption from public records requirements for a corporate governance annual disclosure and supporting documents submitted to the office; providing for and revising future legislative review and repeal; providing a statement of public necessity, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s1416er.DOCX&DocumentType=Bill&BillNumber=1416&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56167'),
(230, 'HB 1417', 'Hillsborough County', 'Revises space requirements for liquor licenses for restaurants.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1417er.docx&DocumentType=Bill&BillNumber=1417&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56467');
INSERT INTO `bills` (`id`, `number`, `name`, `summary`, `fullTextURL`, `url`) VALUES
(231, 'CS/CS/SB 1422', 'Insurer Regulatory Reporting', 'Requiring an insurer to maintain a risk management framework; requiring certain insurers and insurance groups to conduct an own-risk and solvency assessment; requiring certain insurers and members of an insurance group to prepare and submit a corporate governance annual disclosure; requiring the initial corporate governance annual disclosure to be submitted to the Office of Insurance Regulation by a specified date, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s1422er.DOCX&DocumentType=Bill&BillNumber=1422&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56170'),
(232, 'CS/CS/SB 1432', 'Service of Process', 'Expanding the locations at which substitute service of process may be made when such location is the only discoverable address for the person to be served; providing that orders issued by agencies of other states are not enforceable under certain circumstances, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s1432er.DOCX&DocumentType=Bill&BillNumber=1432&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56176'),
(233, 'HB 1433', 'Martin County', 'Repeals provisions relating to issuance of special alcoholic beverage licenses to hotels, motels, motor courts, & certain restaurants.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h1433er.docx&DocumentType=Bill&BillNumber=1433&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56481'),
(234, 'CS/SB 1470', 'Crustaceans', 'Revising the administrative penalties for violations related to stone crab traps and spiny lobster traps; prohibiting the possession of undersized spiny lobsters by certain persons; specifying that each undersized spiny lobster may be charged as a separate offense of certain violations, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s1470er.DOCX&DocumentType=Bill&BillNumber=1470&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56204'),
(235, 'CS/SB 1508', 'Airport Zoning Law of 1945', 'Revising requirements for a permit to construct or alter an obstruction; revising requirements and procedures for certain local political subdivisions to adopt and enforce airport zoning regulations; requiring a permit to construct, alter, or allow an airport obstruction in an airport hazard area under certain circumstances, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s1508er.DOCX&DocumentType=Bill&BillNumber=1508&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56248'),
(236, 'CS/SB 1534', 'Housing Assistance', 'Revising the powers that the Florida Housing Finance Corporation may exercise in developing and administering the State Apartment Incentive Loan Program; requiring that State Apartment Incentive Loan Program funds be made available through a competitive solicitation process, subject to certain requirements; requiring that the State Office on Homelessness coordinate among certain agencies and providers to produce a statewide consolidated inventory for the state’s entire system of homeless programs which incorporates regionally developed plans, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s1534er.DOCX&DocumentType=Bill&BillNumber=1534&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56273'),
(237, 'CS/CS/CS/SB 1602', 'Elevators', 'Creating the "Maxwell Erik ''Max'' Grablin Act"; providing clearance requirements for elevators installed in private residences; requiring certain doors and gates to withstand a specified amount of force; requiring certain doors to reject a sphere of a specified size under certain circumstances; directing the Florida Building Commission to adopt the provisions of the act into the Florida Building Code by a certain date, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s1602er.DOCX&DocumentType=Bill&BillNumber=1602&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56329'),
(238, 'CS/CS/SB 1604', 'Drugs, Devices, and Cosmetics', 'Authorizing a certain type of specialty hospital to conduct research on cannabidiol and low-THC cannabis if contracted with the Department of Health to perform such research; providing, revising, and deleting definitions for purposes of the Florida Drug and Cosmetic Act; revising prohibited acts related to the distribution of prescription drugs; providing that a restricted prescription drug distributor permit is not required for distributions between certain pharmacies; providing for the expiration, renewal, and issuance of certain drug, device, and cosmetic product registrations, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s1604er.DOCX&DocumentType=Bill&BillNumber=1604&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56330'),
(239, 'CS/HB 3509', 'Relief/Andrea Castillo/City of Hialeah', 'Provides for appropriation to compensate Estate of Andrea Castillo for her death as result of negligence of City of Hialeah; provides limitation on payment of fees & costs; provides that amounts awarded are intended to provide sole compensation for all present & future claims related to wrongful death of Andrea Castillo.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h3509er.docx&DocumentType=Bill&BillNumber=3509&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55282'),
(240, 'CS/HB 3515', 'Relief/Q.B./Palm Beach County School Board', 'Providing for an appropriation and annuity to compensate Q.B. for injuries sustained as a result of the negligence of employees of the Palm Beach County School District; providing a limitation on the payment of fees and costs; providing that the appropriation settles all present and future claims related to the negligent act, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h3515er.docx&DocumentType=Bill&BillNumber=3515&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55648'),
(241, 'CS/HB 3517', 'Relief/Alex Zaldivar, Brienna Campos, & Remington Campos/Orange County', 'Provides for appropriation to compensate Estate of Alex Zaldivar for his death, & Brienna Campos & Remington Campos for their injuries & damages sustained as result of negligence by Orange County; provides limitation on payment of fees & costs.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h3517er.docx&DocumentType=Bill&BillNumber=3517&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55669'),
(242, 'CS/HB 3525', 'Relief/Melvin & Alma Colindres/City of Miami', 'Provides for appropriation to compensate Melvin & Alma Colindres for wrongful death of their son, Kevin Colindres, which occurred as result of negligence of police officers of City of Miami; provides limitation on payment of fees & costs.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h3525er.docx&DocumentType=Bill&BillNumber=3525&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55910'),
(243, 'HB 4009', 'Slungshot', 'Deletes provisions prohibiting manufacture or sale of instrument or weapon usually known as slungshot; revises definition of term "concealed weapon" to delete inclusion of slungshot; deletes provision prohibiting dealer in arms from selling or transferring slungshot to minor.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h4009er.docx&DocumentType=Bill&BillNumber=4009&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=54942'),
(244, 'HB 5001', 'General Appropriations Act', 'Provides moneys for annual period beginning July 1, 2016, & ending June 30, 2017, & supplemental appropriations for period ending June 30, 2016, to pay salaries & other expenses, capital outlay—buildings & other improvements, & for other specified purposes of various agencies of state government.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h5001er.docx&DocumentType=Bill&BillNumber=5001&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56555'),
(245, 'HB 5003', 'Implementing the 2016-2017 General Appropriations Act', 'Implements specific appropriations of the General Appropriations Act for the 2016-2017 fiscal year.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h5003er.docx&DocumentType=Bill&BillNumber=5003&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56554'),
(246, 'HB 5005', 'State-administered Retirement Systems', 'Revising required employer retirement contribution rates for each membership class and subclass of the Florida Retirement System; revising the employer assessment rate for offsetting administrative and educational costs related to the Florida Retirement System, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h5005er.docx&DocumentType=Bill&BillNumber=5005&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56553'),
(247, 'HB 5007', 'Collective Bargaining', 'Provides for resolution of collective bargaining issues at impasse between State of Florida & certified bargaining units for state employees pursuant to specified instructions.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h5007er.docx&DocumentType=Bill&BillNumber=5007&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56552'),
(248, 'HB 5101', 'Medicaid', 'Provides procedures for appeals by applicants for public assistance based on agency administering Medicaid program; provides responsibilities of AHCA as hearing authority for certain appeals; authorizes AHCA to adopt rules; exempts rules from certain time requirements; exempts certain agency hearings relating to Medicaid from uniform rules of procedure that require such hearings to be conducted by administrative law judge; revises methodology for establishing reimbursement rates for outpatient hospital services; revises definition of term "Medicaid payments" to include payments for certain outpatient services; requires PACE organization in Broward County to serve frail elders in Miami-Dade County; repeals provisions relating to disproportionate share program.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h5101er.docx&DocumentType=Bill&BillNumber=5101&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56526'),
(249, 'HB 5103', 'Alzheimer''s Disease Research', 'Provides for carryforward of any unexpended balance of  appropriation for Ed & Ethel Moore Alzheimer''s Disease Research Program.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h5103er.docx&DocumentType=Bill&BillNumber=5103&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56527'),
(250, 'SB 7002', 'OGSR/Audit Report and Certain Records/Local Government', 'Amending a provision which provides a public records exemption for the audit report of an internal auditor and certain records relating to investigations in the custody of an inspector general of a local government; removing the scheduled repeal of the exemption, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s7002er.DOCX&DocumentType=Bill&BillNumber=7002&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55115'),
(251, 'CS/HB 7003', 'Individuals with Disabilities', 'Establishes Financial Literacy Program for Individuals with Developmental Disabilities within DFS; requires department to develop & implement program in consultation with specified stakeholders; requires qualified public depository to participate in Financial Literacy Program for Individuals with Developmental Disabilities; creates "Employment First Act"; requires specified state agencies & organizations to develop & implement interagency cooperative agreement; requires DEO, in consultation with other entities, to create Florida Unique Abilities Partner Program.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h7003er.docx&DocumentType=Bill&BillNumber=7003&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55368'),
(252, 'CS/CS/HB 7007', 'Department of Agriculture and Consumer Services', 'Revises, creates, & repeals provisions relating to issues under regulatory oversight of DACS, including issuance of pest control operator''s certificate, limited certification for urban landscape commercial fertilizer application, citrus inspector licensure, Florida Food Safety Act, adulterated & misbranded food products, electronic data processing & management information systems support, use of funds in Pest Control Trust Fund, Division of Marketing & Development, Division of Consumer Services, Office of Agriculture Technology Services, Florida Agriculture Center & Horse Park Authority, Florida Agricultural Promotional Campaign & Advisory Council, fertilizer sales reports & payment of related inspection fees, preemptive regulatory authority for commercial feed & feedstuff & polystyrene products, treatment or destruction of infested or infected plants & plant products, soil & water conservation districts, Florida Forest Service lands for public use, school nutrition programs, affidavit requirements for complaints filed by agricultural products dealers, & reports by & annual inspections of grain dealers, designates official state honey.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h7007er.docx&DocumentType=Bill&BillNumber=7007&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55562'),
(253, 'SB 7012', 'Death Benefits under the Florida Retirement System', 'Authorizing payment of death benefits to the surviving spouse or children of a Special Risk Class member killed in the line of duty under specified circumstances; authorizing payment of death benefits to the surviving spouse or surviving children of a Special Risk Class member in the investment plan; requiring the State Board of Administration to transfer moneys to fund survivor benefit payments under specified circumstances, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s7012er.DOCX&DocumentType=Bill&BillNumber=7012&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55120'),
(254, 'HB 7013', 'Fish and Wildlife Conservation Commission', 'Revising penalties for violations of commission rules or regulations relating to control and management of state game lands; prohibiting certain possession of any marine turtle species or hatchling or parts thereof; providing a penalty for violations relating to possession of recreational hunting, fishing, and trapping licenses, permits, and authorization numbers; providing penalties for violations relating to filing reports and documents by persons who hold alligator licenses and permits; revising penalties for the illegal killing, possessing, or capturing of alligators or other crocodilia or their eggs, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h7013er.docx&DocumentType=Bill&BillNumber=7013&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55642'),
(255, 'SB 7016', 'Interstate Compact on Educational Opportunity for Military Children', 'Providing for payment of annual dues for the compact; repealing s. 2 of chapter 2013-20, Laws of Florida; abrogating the future repeal of provisions relating to the compact; providing for contingent retroactive operation, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s7016er.DOCX&DocumentType=Bill&BillNumber=7016&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55122'),
(256, 'CS/HB 7019', 'Education Access and Affordability', 'Specifying that the costs of instructional materials are not included in tuition for certain online degree programs; requiring the Board of Governors and the State Board of Education to annually identify strategies to promote college affordability; revising provisions relating to textbook affordability to include instructional materials; requiring Florida College System institutions and state universities to provide a public notice relating to increases in tuition and fees, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h7019er.docx&DocumentType=Bill&BillNumber=7019&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55664'),
(257, 'SB 7020', 'OGSR/Florida Health Choices Program/Florida Health Choices, Inc.', 'Amending provisions relating to an exemption from public records requirements for personal identifying information of an enrollee or participant in the Florida Health Choices Program, for client and customer lists of a buyer’s representative held by the Florida Health Choices, Inc., and for proprietary confidential business information held by the corporation, and relating to a penalty for unlawful disclosure of confidential and exempt information; saving the exemption from repeal under the Open Government Sunset Review Act, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s7020er.DOCX&DocumentType=Bill&BillNumber=7020&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55240'),
(258, 'SB 7022', 'OGSR/Depictions or Recordings of the Killing of a Law Enforcement Officer', 'Amending provisions which provide an exemption from public records requirements for a photograph or video or audio recording held by an agency that depicts or records the killing of a person; narrowing the exemption to depictions or recordings of the killing of a law enforcement officer who was acting in accordance with his or her official duties; removing the scheduled repeal of the exemption, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s7022er.DOCX&DocumentType=Bill&BillNumber=7022&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55362'),
(259, 'HB 7023', 'Ad Valorem Tax Exemption for Deployed Servicemembers', 'Expands military operations that qualify certain servicemembers who receive a homestead exemption & were deployed during previous calendar year to receive additional ad valorem tax exemption on that homestead property; provides procedures for grant of exemption.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h7023er.docx&DocumentType=Bill&BillNumber=7023&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55708'),
(260, 'CS/SB 7024', 'OGSR/Information Held by the Florida Center for Brain Tumor Research', 'Amending provisions which provide an exemption from public records requirements for information held by the Florida Center for Brain Tumor Research; removing the scheduled repeal of the exemption, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s7024er.DOCX&DocumentType=Bill&BillNumber=7024&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55363'),
(261, 'HB 7025', 'At-risk Vessels', 'Prohibits vessels that are at risk of becoming derelict from anchoring on, mooring on, or occupying state waters; authorizes FWCC or specified law enforcement officers to determine that vessels are at risk of becoming derelict if certain conditions exist; provides that persons who anchor or moor or allow such a vessel to occupy state waters commit noncriminal violation; provides for enforcement, penalties, & applicability.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h7025er.docx&DocumentType=Bill&BillNumber=7025&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55790'),
(262, 'HB 7027', 'Department of Transportation', 'Revises provisions for Florida Seaport Transportation & Economic Development Program, proposals to refinance transportation projects, facilities whose toll revenues may be used to secure bonds, & amendments to FDOT''s adopted work program; provides fines for certain commercial motor vehicles; authorizes FDOT to assume certain responsibilities of USDOT, enter into certain agreements related to federal surface transportation project delivery program, adopt rules & relevant federal environmental standards, & to establish program to assist small businesses; & establishes Florida Department of Transportation Financing Corporation.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h7027er.docx&DocumentType=Bill&BillNumber=7027&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55813'),
(263, 'SB 7028', 'State Board of Administration', 'Encouraging the State Board of Administration to determine which publicly traded companies in which the Florida Retirement System Trust Fund is invested operate in Northern Ireland; redefining the term “public fund”; requiring the board, rather than the public fund, to maintain a list of certain scrutinized companies rather than assembling the list by a certain time, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s7028er.DOCX&DocumentType=Bill&BillNumber=7028&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55366'),
(264, 'CS/CS/HB 7029', 'School Choice', 'Revises provisions relating to charter schools, virtual education, Credit Acceleration Program, FEFP, educator professional development, & charter school capital outlay funding; creates High Impact Charter Network & Florida Institute for Charter School Innovation.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h7029er.docx&DocumentType=Bill&BillNumber=7029&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55816'),
(265, 'SB 7030', 'OGSR/Competitive Solicitation or Negotiation Strategies', 'Amending provisions which provide an exemption from public records requirements for bids, proposals, or replies submitted to an agency in response to a competitive solicitation; amending provisions which provide an exemption from public meetings requirements for portions of meetings in which a vendor participates in a negotiation, makes an oral presentation, or answers questions as part of a competitive solicitation or in which negotiation strategies are discussed, and which provides an exemption from public records requirements for the recording of, and any records presented at, exempt portions of such meetings; removing the scheduled repeal of the exemptions, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s7030er.DOCX&DocumentType=Bill&BillNumber=7030&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55367'),
(266, 'HB 7033', 'OGSR/Emergency Notification Information', 'Removes scheduled repeal of public records exemption for emergency notification information held by agency.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h7033er.docx&DocumentType=Bill&BillNumber=7033&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55823'),
(267, 'HB 7035', 'OGSR/Office of Financial Regulation', 'Removes scheduled repeal of public records exemption for confidential or exempt information received from certain state or federal agencies & information received or developed by OFR in joint or multiagency examination or investigation.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h7035er.docx&DocumentType=Bill&BillNumber=7035&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55824'),
(268, 'CS/SB 7040', 'Workforce Development', 'Authorizing a county or state official to be granted leave of absence from his or her office to serve in the National Guard of any state; providing implementation of the federal Workforce Innovation and Opportunity Act through a 4-year plan; deleting a provision authorizing an optional federal partner to fulfill certain state planning and reporting requirements; revising the entities required to collaborate with CareerSource Florida, Inc., to establish certain performance accountability measures; requiring CareerSource Florida, Inc., to establish regional planning areas subject to certain requirements by a certain date, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s7040er.DOCX&DocumentType=Bill&BillNumber=7040&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56063'),
(269, 'SB 7048', 'OGSR/Client Records and Donor Information Collected by Regional Autism Centers', 'Amending provisions which provide an exemption from public records requirements for information relating to client records and donor information collected by regional autism centers; removing the scheduled repeal of the exemption, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s7048er.DOCX&DocumentType=Bill&BillNumber=7048&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56432'),
(270, 'CS/HB 7053', 'Child Care and Development Block Grant Program', 'Expands list of entities that have access to child abuse records for approving providers of school readiness services; requires school readiness program providers to provide DCF & local licensing agencies with access for inspection purposes; requires certain child care providers to submit affidavit of compliance with licensure requirements of ch. 402, F.S., & federal law; provides criteria for exemption from disqualification for employment with school readiness program provider; revises duties of OEL; revises provisions relating to child & parent eligibility for school readiness programs.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h7053er.docx&DocumentType=Bill&BillNumber=7053&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=55840'),
(271, 'CS/CS/HB 7061', 'Transportation', 'Establishing the Seaport Security Advisory Committee directed by the Florida Seaport Transportation and Economic Development Council; revising requirements and procedures for certain local political subdivisions to adopt and enforce airport zoning regulations; repealing provisions relating to the Pinellas Bayway; authorizing the Division of Alcoholic Beverages and Tobacco of the Department of Business and Professional Regulation to issue a license for the sale of beer and wine on certain commercial megacycles, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h7061er.docx&DocumentType=Bill&BillNumber=7061&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56483'),
(272, 'HB 7071', 'Public Corruption', 'Revising the definition of the term "bribery"; revising requirements for prosecution; revising the prohibition against unlawful compensation or reward for official behavior to conform to changes made by the act; revising the prohibition against official misconduct to conform to changes made by the act; revising applicability of the offense to include public contractors; revising the prohibition against bid tampering to conform to changes made by the act, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h7071er.docx&DocumentType=Bill&BillNumber=7071&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56497'),
(273, 'SB 7076', 'Legislature', 'Fixing the date for convening the 2018 Regular Session of the Legislature, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_s7076er.DOCX&DocumentType=Bill&BillNumber=7076&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56569'),
(274, 'CS/CS/HB 7087', 'Health Care', 'Requiring the Agency for Health Care Administration, the Department of Health, and the Office of Insurance Regulation to collect certain information; creating the Telehealth Advisory Council within the agency for specified purposes; reenacting provisions relating to provider payment of managed medical assistance program participants, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h7087er.docx&DocumentType=Bill&BillNumber=7087&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56511'),
(275, 'HB 7091', 'Trust Funds/Termination & Administration/Working Capital Trust Fund/DCF & Operations and Maintenance Trust Fund/DOH', 'Terminates specified trust funds within DCF & DOH; provides for disposition of balances in & revenues of such trust funds; prescribes procedures for termination of such trust funds.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h7091er.docx&DocumentType=Bill&BillNumber=7091&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56538'),
(276, 'HB 7099', 'Taxation', 'Specifying additional uses for revenues received from tourist development taxes for certain coastal counties; revising an economic development ad valorem tax exemption for certain enterprise zone businesses; revising a date relating to the payment of debt service for certain bonds; providing procedures to be used when a person, other than a dealer, is required but fails to remit certain taxes; exempting the sales of food or drinks by certain qualified veterans'' organizations; adopting the 2016 version of the Internal Revenue Code; authorizing the Division of Alcoholic Beverages and Tobacco within the Department of Business and Professional Regulation to independently verify certain reported information; authorizing certain dealers to elect not to participate in such tax exemptions, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h7099er.docx&DocumentType=Bill&BillNumber=7099&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56550'),
(277, 'HB 7101', 'Sentencing for Capital Felonies', 'Requiring the prosecutor to give notice to the defendant and to file the notice with the court within a certain timeframe if the prosecutor intends to seek the death penalty; requiring juries to determine the existence of aggravating factors, if any, in the penalty phase of capital cases; requiring a certain determination by at least 10 jurors to support a recommendation of a sentence of death; deleting provisions relating to advisory sentencing by juries and findings by the court in support of sentences of death, etc.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h7101er.docx&DocumentType=Bill&BillNumber=7101&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56559'),
(278, 'HCR 8003', 'Joint Session for Purpose of Receiving Governor''s Message', 'Calls for House of Representatives & Senate to convene in Joint Session at 11:00 a.m. on January 12, 2016, for purpose of receiving message from Governor.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h8003er.docx&DocumentType=Bill&BillNumber=8003&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56320'),
(279, 'HCR 8005', 'Adjourning & Reconvening of Legislature/2016 Regular Session', 'Provides for adjourning & reconvening of each house of Legislature & provides for adjournment sine die during 2016 Regular Session.', 'http://www.myfloridahouse.gov//Sections/Documents/loaddoc.aspx?FileName=_h8005er.docx&DocumentType=Bill&BillNumber=8005&Session=2016', 'http://www.myfloridahouse.gov/Sections/Bills/billsdetail.aspx?BillId=56321');
INSERT INTO `representatives` (`id`, `fname`, `lname`, `district`, `party`, `county`) VALUES
(1, 'Janet H.', 'Adkins', '11', 'R', 'Nassau and part of Duval'),
(2, 'Larry', 'Ahern', '66', 'R', 'Part of Pinellas'),
(3, 'Ben', 'Albritton', '56', 'R', 'DeSoto, Hardee and part of Polk'),
(4, 'Bruce', 'Antone', '46', 'D', 'Part of Orange'),
(5, 'Frank', 'Artiles', '118', 'R', 'Part of Miami-Dade'),
